INSERT INTO `car_rent` VALUES (1,'SAFARI LANDCRUISER','uploads/tourism/carRent/1581967879.jpeg',150,'$','The Extended safari Land cruiser is a four wheel drive car customized for safaris. Uniquely designed with a pop up roof. The safari Land cruiser can accommodate up to 8 people and has enough space for cargo making it suitable for family trips, camping and self drive road trips. It\'s designed to operate even in the toughest environments like on rough murram roads in the country side.','2020-02-17 19:31:19','2020-03-05 19:44:32'),(2,'TOYOTA COASTER BUS','uploads/tourism/carRent/1581968078.jpg',170,'$','The Toyota Coaster Bus is a series of minibuses manufactured by Toyota; Japan’s leading automobile company Equipped with 5-speed manual transmission and a high roof, the coaster bus is a suitable vehicle for group tours, school trips, sports trips as well wedding events','2020-02-17 19:34:38','2020-03-05 19:41:05'),(4,'LANDCRUISER V8','uploads/tourism/carRent/1581969291.jpg',180,'$','Built for remote terrain around the globe, the hulking Toyota Land Cruiser feels forced into suburbia. It\'s highly refined, with poise and presence, but it can\'t escape its truck roots. It seats eight, but the third row is more of a jump seat. With hydraulic suspension to smoothen the ride and escape those roots.','2020-02-17 19:54:51','2020-03-05 19:41:14'),(6,'LAND-CRUISER VX','uploads/tourism/carRent/1581970646.jpeg',100,'$','Toyota Land cruiser-VX is a four wheel drive car customized for safaris. Uniquely designed with a pop up roof. This safari Land cruiser can accommodate up to 8 people making it suitable for family trips,It\'s designed to operate even in the toughest environments.','2020-02-17 20:17:26','2020-03-05 19:41:21'),(7,'Land-cruiser TXL','uploads/tourism/carRent/1583075313.png',130,'$','A true all-rounder, the Land Cruiser Prado provides the styling and comfort you expect from a top of the range vehicle, whilst also answering the demands of the toughest off-road terrains. Many organisations find this model to be the perfect combination for urban usage and off-road leadership.','2020-03-01 15:08:33','2020-03-05 19:42:58'),(8,'Toyota RAV4','uploads/tourism/carRent/1583076398.jpg',50,'$','If you want a small-to-midsize sport utility vehicle that combines car-like performance, ride, handling and fuel economy with available four-wheel drive and room for up to 5 passengers and a fair amount of cargo, Toyota RAV4 is a good choice.','2020-03-01 15:26:38','2020-03-05 19:41:36'),(9,'VIP MINI-BUS','uploads/tourism/carRent/1583180968.jpg',140,'$','This 14 Seater Toyota Hiace has sleek minimalist styling with enhanced rear and the front grille. It is set to make your business group feel confortable anywhere, anytime. Your Comfort is how you decide it to be. The Hiace is tailored to suit your requirements, assuring your business efficiency and to be your most reliable choice.','2020-03-02 20:29:28','2020-03-05 19:43:07'),(10,'Land Rover Discovery','uploads/tourism/carRent/1583181207.jpg',100,'$','The Discovery was Land Rover\'s first model, that was positioned as a family car, designed to be both fully off-road capable, and suitable as a daily driver for any family, even offering more luggage space, and optionally more seats than the Range Rover.','2020-03-02 20:33:27','2020-03-05 19:42:13');
