INSERT INTO `products` VALUES (289,1,101,'1562929392.jpg','Sport music Hearing Aid Earphone','10000','2','High Fidelity Sound 11mm vibrating diaphragm, CSR chip and Bluetooth technology deliver Built-in mic for stereo sound and super bass sound. Clear high & low volume, makes calls clear and stable protects the headphones from heavy rains or sweat throughout intense exercises; just enjoy your time when running, jogging, riding, hiking, fitness, or in the gym Foolproof operation: Control buttons On the headphones so that you can play and pause music, adjust the volume, skip tracks, answer and end calls, and activate the voice control of your phone with one Simple operation on the headphones Long Playtime. Only 2 hours charge gives you up to 8 hours talk time/audio play time, enough to power your workouts with music for a week Comfortable and Stable Lightweight and ergonomic design, customizable accessories with large, medium, and small size of gel eartips; soft silicon earhooks ensure comfortable in even most intense workout',NULL,'4',NULL,NULL,'2019-07-12 11:03:12','2019-09-10 13:32:56','Europe','RWF','None',0,'','Visible',NULL,NULL,0,'simple_product'),(290,1,101,'1562935006.jpg','Black-Bluetooth-earphones.','10000','2','Bluetooth-earphones Style: In-Ear Communication: Wireless Connectors: Use: Mobile Phone adm computers Function: Bluetooth, Noise Cancelling, Microphone Cord Length: Bluetooth Waterproof Standard: IPX-4Product name: Bluetooth wireless earbudsKeyword: True Wireless EarbudsVersion: V4.2+EDR Wireless EarbudsFeature: Mini,Waterproof,Large Batterychagring box battery: 600mahOperation Range: Up to 10 metersUsage: Mp3/Cell phone /earphone Battery Capacity: 55mAHCharging time: 1-2 Hours',NULL,'0',NULL,NULL,'2019-07-12 12:36:46','2020-01-16 08:16:36','Pieces','RWF','None',0,'','Visible',NULL,NULL,0,'simple_product'),(294,1,95,'1563112417.jpg','Children-Golden-Led-Flash-Shoes','15000','2','The surface of the shoes is waterproof, but please take the battery out if you want to wash them! Don\'t wash the shoes frequently, you can use soft cloth to clean them.Charge Instruction: Easy charge like your cell phone with the attached USB charging cable. Switch on the shoes when received and light up until all power gone. Then charge both shoes for 3 hours, which can provide 8~11 hours of lighting time.Using Instruction:There is a switch on the inside of the shoe . So you have a choice with turning them completely off. Do not wear this shoes when you do strenuous exercise it may damage electronic cables.',NULL,'4',NULL,NULL,'2019-07-14 13:53:37','2019-10-16 09:07:15','Erope','RWF','None',0,'','Visible',NULL,NULL,0,'simple_product'),(295,1,95,'1563112891.jpg','Children-Pink-Led-Flash-Shoes','15000','2','The surface of the shoes is waterproof, but please take the battery out if you want to wash them! Don\'t wash the shoes frequently, you can use soft cloth to clean them.Charge Instruction: Easy charge like your cell phone with the attached USB charging cable. Switch on the shoes when received and light up until all power gone. Then charge both shoes for 3 hours, which can provide 8~11 hours of lighting time.Using Instruction:There is a switch on the inside of the shoe . So you have a choice with turning them completely off. Do not wear this shoes when you do strenuous exercise it may damage electronic cables.',NULL,'7',NULL,NULL,'2019-07-14 14:01:31','2019-10-16 09:09:54','Erope','RWF','None',0,'','Visible',NULL,NULL,0,'simple_product'),(296,1,95,'1563114592.jpg','Children-Red-Led-Flash-Shoes','15000','2','The surface of the shoes is waterproof, but please take the battery out if you want to wash them! Don\'t wash the shoes frequently, you can use soft cloth to clean them.Charge Instruction: Easy charge like your cell phone with the attached USB charging cable. Switch on the shoes when received and light up until all power gone. Then charge both shoes for 3 hours, which can provide 8~11 hours of lighting time.Using Instruction:There