INSERT INTO `tour_agendas` VALUES (609,1151,'13:00','18:00','KIGALI','Welcome! This day at your arrival, you will be picked by our driver guide (Company representative) and then transfer you to your hotel in Kigali for a relaxation moment after the long flight and briefing about this great adventure tour. Overnight and Dinner at a hotel in Kagali.','2019-06-21 08:36:22','2020-03-17 15:13:34'),(610,1152,'07:00','18:00','Kigali -Nyungwe National Park','After Morning breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, from here you will drive to Nyungwe forest having our lunch en-route in Huye, and proceed to Nyungwe National park head Office for our 3pm Canopy walkway. Overnight and Dinner at a hotel in Nyungwe National Park.','2019-06-21 08:38:08','2020-03-17 15:15:27'),(611,1153,'07:00','18:00','Nyungwe National Park -Kibuye','After Breakfast, Drive to the park headquarters to be briefed about the “dos and don’ts” while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will be transferred to Karongi, where you will connect to your Hotel for relaxation. Overnight and Dinner at a hotel in Kibuye.','2019-06-21 08:40:12','2020-03-17 15:22:51'),(612,1154,'08:00','18:00','Kibuye - Volcanoes National Park','Early morning after breakfast, you will do a boat ride at lake Kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying Kivu lake, you will go for lunch before being transferred to Volcanoes National Park. The distance from Karongi to Volcanoes National Park it’s about 156Km and road takes about 3hours with no rush. Overnight and Dinner at a hotel in Musanze.','2019-06-21 08:41:41','2020-03-17 15:23:18'),(613,1155,'06:00','18:00','Volcanoes National Park - Kigali','After early morning breakfast, you will be transferred to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will drive back to Kigali International Airport for your departure flight.','2019-06-21 08:43:01','2020-03-05 17:16:01'),(720,1267,'15:30','18:00','Arusha (Tanzania)','Arrival at Airport and meet a driver guide who will transfer you to your respective hotel/lodge in Arusha. On arrival, check in at your Hotel where you will spend a night.','2019-06-27 16:20:54','2019-06-27 16:20:54'),(723,1268,'06:00','18:30','Arusha - Serengeti National Park','After breakfast, drive to Serengeti national park home to 3 million animals which is larger than any savannah protected area on earth. When you enter Serengeti before you check in your lodge, you will visit the UNESCO heritage site Oduvai gorge where the early humans thought to have occupied about 2 million years ago. You will learn much about the human evolution with the research of Dr. Louis leaky who discovered the human skull and other fossils at the site in 1960. Continue to your lodge inside Serengeti.','2019-06-27 16:22:08','2019-06-27 16:22:08'),(724,1269,'07:00','18:00','Serengeti National Park','Serengeti offers best wildlife viewing opportunities. It is home to 3 million animals, including large prides of lions, herds of elephants, wildebeest, gazelles, buffalo, buffalo, zebras, and a variety of birds like ostrich. The game drive will start at sunrise explore the area to spot nearly all the large mammals mentioned above. You will return to the camp for lunch. In the afternoon animals will be more active and continue with your game drive. There’s an option to do a hot air balloon safari over the Serengeti.','2019-06-27 16:23:14','2019-06-27 16:23:14'),(725,1270,'07:00','18:00','Serengeti National Park -Arusha','On your last day, you will enjoy an early morning game drive. At 10am you return and transfer to Arusha airport for your return flight home.','2019-06-27 16:24:26','2019-06-27 16:24:26'),(804,1389,'08:00','18:00','Rwanda -Congo','Meeting at the border Grande Barrière Rwanda-DRC. Welcoming with our staff at the border. Assisted to clear with formalities. Ensure crossing the border at 10:30 am and check-in with Virunga tourism office by 11:15am which is located in the Grande Barrière border post building, opposite passport control. Once check-in is complete, transfer to Kibumba.','2019-08-17 17:21:32','2019-08-17 17:21:32'),(805,1390,'06:30','18:00','Virunga Park(Congo)','After an early breakfast at Kibumba Tented Camp, trekkers will head down the hill to meet their Ranger guides and have a briefing before the gorilla trek. Treks usually require 1-2.5 hours of hiking each way, depending on location of the gorilla group being trekked and the difficulty of the terrain. After spending the allotted hour with the gorilla family group, trekkers will make their way back to camp, enjoy a late lunch and have the rest of the day at leisure, including time for nature walks and bird watching.','2019-08-17 17:22:37','2019-08-17 17:22:37'),(806,1391,'08:00','18:00','Virunga Park(Congo)','After breakfast in Kibumba, guests will be transported to the Kibati Ranger Post at 8:15am, where treks to the summit of Nyiragongo volcano begin. On arrival to Kibati, guests will receive a briefing. Park rangers lead all treks and porters (unaffiliated with the park) are available for hire at Kibati ranger station. The time required to reach the summit depends on the average fitness of each group, but typically takes 4 – 6 hours. It is possible for fitter people to climb up and descend in one day, but the vast majority chooses to overnight in the basic accommodations available at the top (included in the permit fee) because the best time to view the lava lake is at night. Sunset at the summit of Nyiragongo. Enjoy watching, in the night, the world’s largest lava lake. Dinner and overnight at the summit of Nyiragongo Volcano in the shelter.  \r\nTrekkers are strongly advised to bring full rain and cold weather gear (moisture-wicking base layer, sweater or fleece, jacket, rain resistant pants, long underwear, warm socks, hat, and a 0°C/32° – rated sleeping bag), good walking shoes, sun cream, etc.','2019-08-17 17:32:26','2019-08-17 17:32:26'),(807,1392,'07:00','18:00','Virunga Park(Congo) -Rwanda','After a very early morning visit to the lava lake, have your breakfast around 7:00 am. After breakfast, start descending the volcano and arrive back at Kibati station. Average descent time is four hours. Drive back to Goma town. Be transferred back to the border and return to Rwanda, to Kigali International Airport for departure.','2019-08-17 17:33:57','2019-08-17 17:33:57'),(808,1402,'06:30','18:00','Kigali - Uganda (Bwindi National Park)','You will be picked up by our guide from your location in Kigali and proceed to the Rwanda-Uganda border crossing at Cyanika. Stop over at Kisoro Town for Lunch and a short rest. After lunch, you will head out for the Batwa experience. Dinner and Overnight at Rushanga Gorilla Camp.','2019-09-02 13:27:00','2020-03-02 19:26:12'),(809,1403,'06:30','18:00','Bwindi  National Park  - Kigali (Rwanda)','Have an early breakfast and head out to the Park headquarters for a briefing before the Trekking experience. At 8:30am, Head out into the Park for the Gorilla Trekking experience with the park rangers and guides. The Trekking exercise can take between 1-8 hours depending on the movements of the gorillas. In the afternoon after trekking, head back to the hotel for Lunch and some relaxation. Later, drive back to Rwanda-Kigali and be dropped at your desired Location.','2019-09-02 13:32:04','2020-03-02 19:27:12'),(833,1432,'07:00','18:00','Kampala - Jinja','Our 1 Days Jinja city tour, starts from Kampala as early as 7:00am and takes you to visit sites like the Ssezibwa falls, enroute, the Mabira forest for a zip lining activity. You will then proceed to go have lunch in Jinja at Jinja Nile resort near the shores. Later you will visit the source of the Nile. Take a boat to the actual point believed to be the point where the Nile separates from Lake Victoria and then return to the starting point. You will then go visit the Kagulu hills and the Busoga king’s palaces, before you start your journey back to Kampala.','2019-09-06 11:28:17','2019-09-06 11:28:17'),(898,1513,'18:00','18:30','Kigali','Welcome! this day at your arrival, you will be picked by our diver guide and transfer your Hotel in Kigali for overnight and dinner.','2019-10-14 14:45:40','2020-03-17 15:10:21'),(899,1514,'06:00','18:00','Akagera National Park','Have early breakfast and prepare to start the trip. Leave for Akagera National Park which is located in the northeastern of Rwanda, along the border with Tanzania. Akagera is Rwanda’s largest national park, covering 1,122 square kilometers of savannah, mountain and swamp habitat. On arrival to the park, you will do a short game drive for your first animal sightings, and enjoy the beautiful scenery of the park. From the game drive transfer to your accommodation for lunch. In the afternoon you will do a boat safari on Lake Ihema. At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. Later, return to the lodge for dinner and overnight at a hotel in Akagera National Park.','2019-10-14 14:47:02','2020-03-17 15:10:53'),(900,1515,'08:00','18:00','Akagera National Park -Kigali','Have a relaxed full board breakfast at the hotel and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc.  With your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, you’ll continue with the game drive heading north of the park. You’ll drive back to Kigali and arrive at around 6pm. Dinner and Overnight at a hotel in Kigali.','2019-10-14 14:47:46','2020-03-17 15:11:42'),(901,1516,'09:00','18:00','Kigali International airport','After your breakfast, take a visit to Gisozi Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight.','2019-10-14 14:48:40','2020-02-03 10:46:22'),(902,1517,'13:00','18:00','Kigali -Volcanoes National Park','Upon arrival, you will be welcomed by your G-STEP TOURS driver/guide, briefed about Rwanda Cycling Tour and drive north of Rwanda to Volcanoes National Park, viewing the spectacular scenery of the Virunga Mountains en route. Dinner and overnight stay at a hotel in Musanze-Kinigi.','2019-10-14 15:13:06','2020-03-17 13:40:46'),(903,1518,'07:00','18:00','Volcanoes National Park','Begin your day with breakfast early and with your cyclist guide, you will cycle towards the twin lakes close to the border of Rwanda – Uganda namely Lake Burera and Lake Ruhondo. The cycling tour will take you through different small villages where you will have extended time interacting with the locals is this is of interest to you. You will arrive at the twin’s lakes and order for your lunch before exploring the area further with a short hike. Dinner and Overnight at a hotel in Burera.','2019-10-14 15:14:19','2020-03-17 13:43:23'),(904,1519,'07:00','18:00','Volcanoes National Park','After your breakfast, you will start the cycling trip with a stopover at one of the biggest swamps in Rwanda called Rugezi swamp in case you missed it the previous day. For those who are interested in birds, you may have a few minutes to sight some birds before continuing on the trip.  Enjoy the scenery one last time before starting the journey back to Musanze. Dinner and Overnight at your hotel in Musanze.','2019-10-14 15:15:17','2020-03-17 13:44:32'),(905,1520,'07:00','18:00','Volcanoes National Park - Kigali','After breakfast, you will pack up and begin your journey back to Kigali. Upon reaching Kigali, you will go for a Kigali city tour. You may also visit the genocide memorial site at Kigali. Thereby ending your 4 days Rwanda cycling tour. Your Guide will thereafter take you back to your hotel or Airport.','2019-10-14 15:18:48','2020-02-03 11:44:49'),(915,1532,'07:00','18:00','Kigali - Uganda (Bwindi National Park)','You will be picked up by our guide from Kigali and proceed to the Rwanda-Uganda border crossing at Cyanika.\r\nStop over at Kisoro Town for Lunch and a short tour of the small border Town. After the short tour, Leave Kisoro Town to your accommodation in Bwindi.\r\nOvernight and Dinner at  Icumbi Gorilla Lodge.','2019-10-16 11:20:26','2020-03-06 09:30:44'),(916,1533,'07:30','18:00','Mbwindi Impenetrable National Park','Have an early breakfast and head out to the Park headquarters for a briefing before the Trekking experience.\r\n At 8:30am, Head out into the Park for the Gorilla Trekking experience with the park rangers and guides. \r\nThe Trekking exercise can take between 1-8 hours depending on the movements of the gorillas.\r\nIn the afternoon after trekking, head back to the hotel for Lunch and some relaxation.\r\nIn the evening, head out for the Batwa experience. After that, return to your Hotel For dinner and overnight at Icumbi Gorilla Lodge.','2019-10-16 11:22:03','2020-03-06 09:31:14'),(917,1534,'08:00','18:00','Uganda -Rwanda','After breakfast, embark on your drive back to Rwanda via Lake Burera and Lake Ruhondo where you will do a boat ride on the lake where you will enjoy the beauty of the twin lakes and lots birds.\r\nLater in the evening, drive back to Kigali and be dropped at your desired location.','2019-10-16 11:27:29','2019-10-16 11:27:29'),(918,1535,'03:00','18:00','Rwanda - Uganda','Our tour guide will pick you from a hotel in Kigali and cross you over to Uganda through Katuna Immigration boarder point to the northern sector of Bwindi impenetrable Forest national park. This scenic drive will take approximately 3 hours at a speed of 60KM/hr. Check-in the Hotel on arrival and have some good rest. (Dinner and Overnight at Icumbi Gorilla Safari Lodge)','2019-10-16 13:54:20','2019-10-16 13:54:20'),(919,1536,'07:00','18:00','Bwindi Impenetrable National Park','Have an early breakfast and head to the park headquarters for briefing from the park rangers about the dos and don’ts while with the gorillas. Proceed for the memorable adventure penetrating the impenetrable forest in search for the gentle giants. This may take 2-8 hours depending on the movement of the animals. You will spend a maximum time of one hour enjoying the gorillas play, feed or rest while taking your observations and photographs. After lunch, you will go for Batwa experience. where you will be entertained and given tales of their unique culture. Dinner and overnight at Icumbi Gorilla Safari  Lodge.','2019-10-16 13:55:36','2019-10-16 13:55:36'),(920,1537,'07:00','18:00','Bwindi Impenetrable National Park','Just like the previous day, you will have an early morning breakfast and transfer to the park headquarters for briefing. You will probably trek a different gorilla family but all following different trails. Dinner and overnight at Icumbi Gorilla Safari Lodge.','2019-10-16 13:57:15','2019-10-16 13:57:15'),(921,1538,'08:00','18:00','Uganda -Rwanda','Take your breakfast at leisure at your hotel and later be ready to drive back to Rwanda. Your guide will drop you at your hotel or at the airport for your scheduled flight back home.','2019-10-16 13:58:15','2019-10-16 13:58:15'),(922,1539,'15:00','18:00','KIGALI','Upon arrival at Kigali Airport, you will meet your tour guide (Our company representative) and then transfer you to your Hotel in Kigali for a welcome meal, briefing about this great adventure safari. If time allows, take a city tour in Kigali.  Dinner and Overnight stay at Mille Collins Hotel.','2019-10-17 15:03:01','2019-10-17 15:03:01'),(923,1540,'08:00','18:00','Volcanoes National Park - Uganda','After breakfast, drive to ibyiwacu cultural village in Musanze to learn about the Rwandan culture and traditions. After lunch you will drive to Uganda, check-in at Bunyonyi Safari Lodge for Dinner and Overnight.','2019-10-17 15:03:54','2019-10-17 15:03:54'),(924,1541,'08:00','18:00','Lake Bunyonyi -Bwindi national park','This Morning after breakfast, you will do a boat ride and hiking on Lake Bunyonyi, visit the neighboring islands and get the history of each islands, you will also get a chase to view various birds like the grey crowned crane, red-chested sun birds and many fly catchers. After lunch you will drive to bwindi impenetrable national park. Dinner and Overnight at Icumbi Gorilla Safari Lodge','2019-10-17 15:05:41','2019-10-17 15:05:41'),(925,1542,'07:00','18:00','Bwindi National Park -Kigali','Have an early breakfast and head out to the Park headquarters for a briefing before the Trekking experience. At 8am, Head out into the Park for the Gorilla Trekking experience with the park rangers and guides. The Trekking exercise can take between 1-8 hours depending on the movements of the gorillas. After lunch drive back to Kigali and be dropped at mille Collins hotel for dinner and overnight.','2019-10-17 15:07:38','2019-10-17 15:07:38'),(926,1543,'08:00','18:00','Kigali International airport','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight','2019-10-17 15:08:41','2019-10-17 15:08:41'),(942,1558,'09:00','18:00','Kigali -Akagera National Park','You will be picked up from our office Remera/ Kisimenti  and then drive to Akagera National Park. Driving East of Rwanda (3 hours’ drive). On arrival at the park, we shall have Lunch and short rest. In the afternoon, you will head out for an amazing canoe ride on Lake Ihema. At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. Dinner and Overnight at Akagera Game Lodge.','2019-10-21 14:01:39','2019-10-21 14:01:39'),(943,1559,'08:00','18:00','Akagera National Park -Kigali','Have a relaxed breakfast at your hotel and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc.  With your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, you’ll continue with the game drive heading north of the park. You’ll drive back to Kigali and arrive at around 6pm.','2019-10-21 14:03:05','2019-10-21 14:03:05'),(946,1564,'05:00','18:00','Kigali -Volcanoes National Park','You will be picked up from G-STEP TOURS Office at Kisemeti by your driver/guide then head to Volcanoes National park-home to the remaining mountain gorillas in the world, connect directly to the park headquarters for a briefing about the activity as early as 7am, you will then be allocated the ranger guides and you head for the hike. \r\nKarisimbi volcano is the highest of the 8 mountain peaks of Virunga conservation region (Nyiragongo and Nyamuragira volcanoes). The hike is strenuous and challenging so you need to be physically fit to do this hike. \r\n\r\nThis is a 6 hours hike with great views, different bird species and primates. On reaching at an altitude of about 3700m, you will stop at the first camping site where you will spend a night.','2019-10-21 14:31:02','2019-10-21 14:31:02'),(947,1565,'06:00','18:00','Volcanoes National Park - Kigali','After early breakfast, embark on an hour’s hike to the summit. At this level the hike is very steep going through trials of thick jungles surrounded by a stunning scenery. \r\nOn reaching at the summit, enjoy amazing views of the surrounding areas like mount Muhabura. After enjoying your time at the summit descent to the starting point where you will meet your driver readily waiting to receive you and connect for late lunch (Self sponsored), Later embark on your journey back to Kigali city.','2019-10-21 14:33:05','2019-10-21 14:33:05'),(948,1566,'08:00','18:00','Kigali -Nyungwe national park','You will be picked up from our office Remera/Kisimenti and then drive to the western province, on your way visit the Royal Palace Museum in Southern Province and later head for an en-rooted lunch in Huye. After lunch you head to Nyungwe National Park for a canopy walk and return in the afternoon for dinner and overnight stay at Peace Guest House.','2019-10-22 11:42:41','2019-10-22 11:42:41'),(949,1567,'07:00','18:00','Nyungwe National Park -Kigali','Morning After break, you will visit Karamazovu  swamp. This activity will take 1-5hours The trail has a lot of wildflowers along it and there’re non-forest birds- on the way you will have 360degrees view of the park and even see Lake Kivu in the distance. On a clear day, you can even also see the majestic Virunga Volcanoes that seem to tower over Rwanda. After Lunch you will drive back to Kigali.','2019-10-22 11:46:12','2019-10-22 11:46:12'),(950,1568,'13:00','18:00','Kigali -Akagera National Park','You will be picked up from Office Kisimenti/Remera at 1:00pm and then drive to Akagera National Park. \r\nDriving East of Rwanda (3 hours’ drive). On arrival at the park, we shall have a short game drive. Later driver to your hotel for dinner and overnight at a hotel in Akagera National Park.','2019-10-22 12:11:59','2020-03-17 13:36:35'),(951,1569,'06:00','18:00','Akagera National park - Musanze','Rise a bit early (6:00am) and after breakfast, set off for a wonderful morning game drive through the savannah woodlands to have clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. You will enjoy your packed lunch at the Hippo beach in the middle of Akagera National Park, and later drive to Volcanoes National park. Overnight and dinner at a hotel in Musanze.','2019-10-22 12:20:45','2020-03-17 13:38:58'),(952,1570,'05:00','18:00','Volcanoes National Park - Gisenyi','Early morning breakfast, transfer to the park headquarters for briefing from the park warden about the endangered golden monkeys. After connect to the tracking starting point and enter the forest to search for the rare golden monkey. This activity can take about 1-5 hours and is done at closer view of the other primates in the park like the red tailed monkeys, Velvet monkeys among other. After viewing the rare golden monkeys for an hour while taking pictures and studying their behaviors. After Lunch and short rest, drive to Gisenyi . Dinner&Overnight at  a hotel in Gisenyi.','2019-10-22 12:30:30','2020-03-17 13:39:33'),(953,1571,'09:00','18:00','Gisenyi-Kigali','Morning  after breakfast, you will go for boat ride enjoying the beautiful water, Visit Rubona Peninsula, Hot springs and see the amazing bird life, engage with friendly communities and do something unique in almost all of Africa. Later back to your hotel for lunch and relax, after lunch you will drive back to Kigali.','2019-10-22 12:32:14','2019-10-22 12:32:14'),(954,1572,'06:00','18:00','Kigali -Akagera National Park','You will be picked up by our company representative from your Hotel or Kigali International Airport for a road trip to Akagera National Park.\r\nDriving East of Rwanda (3 hours drive). In the afternoon, you will head out for an amazing canoe ride on Lake Ihema.  At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. Dinner and Overnight at Akagera Game Lodge.','2019-10-22 13:36:10','2019-10-22 13:36:10'),(955,1573,'06:00','18:00','Akagera National Park -Kigali','Rise a bit early (6:00am) and after breakfast, set off for a wonderful morning game drive through the Savannah woodlands to have clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. You will enjoy your packed lunch at the Hippo beach in the middle of \r\nand dive back to Kigali for a beautiful Night City Tour. Dinner and Overnight at Great Apartment Hotel.','2019-10-22 13:40:22','2019-10-22 13:40:22'),(956,1574,'08:00','18:00','Kigali -Nyungwe national park','Enjoy an early morning breakfast and then head South West to the verdant Nyungwe Forest National Park via the King’s royal palace museum Nyanza \r\nDuring a 2-hours drive, you will experience the culture of ancient Rwandans. After the stopover, will continue to the Uwinka overlook to be briefed and proceed with your guide to the canopy walk adventure. \r\nThe first 200m is a walk along the forest trail under the thick canopies for an opportunity of viewing the ground level nature before taking on the canopy walk-way to get to the top level of the forest. \r\nThe prominent sightings here include; The blue monkeys, L’Hoest’s monkeys, black and white colobus, the red tailed monkeys and the birds. \r\n•	Remember to carry a rain coat and hiking shoes but both can be rented from the reception Canter. \r\n•	The walking sticks are provided free of charge. \r\n•	The minimum age for this walk is 6 years and the kids must be escorted by the adults.\r\n•	This canopy walk takes close to 2 hours.\r\nDinner and Overnight at Gisakura Guest House.','2019-10-22 13:43:01','2019-10-22 13:43:01'),(957,1575,'05:00','18:00','Nyungwe National Park -Kibuye','After Breakfast, Drive to the park headquarters to be briefed about the “dos and don’ts” while with the chimps before entering the forest, you will encounter the chimps and many other primates like the black and white monkeys and various bird species, and later, return to your hotel for lunch and in the evening time drive to Karongi.\r\nThis is 1hr50min drive from Nyungwe to Karongi, Connect to your Hotel in karongi for relaxation, dinner and overnight Delta Hotel.','2019-10-22 13:44:38','2019-10-22 13:44:38'),(958,1576,'08:00','18:00','Kibuye -Kigali','Early morning after Breakfast, you will visit the Environmental museum where you will see Traditional herbal medicines and Animal photo displays plus others.\r\nFrom here you will do a boat ride in lake kivu visiting Amahoro Island, Inyenyeri Island, Napoleon Island.\r\nAfter enjoying kivu lake, you will go for lunch and later drive back to Kigali.','2019-10-22 13:49:27','2019-10-22 13:49:27'),(981,1611,'08:00','18:00','Burundi','You will be picked from the airport, have a half day tour in Bujumbura for a cultural safari. Then drive to Rusizi National Park for a boat cruise in Rusizi river, views such as hippos, birds and the joining point between Rusizi River and Lake Tanganyika.\r\nContiue for rewards of the belvedere hikes offering a beautiful view of Bujumbura city and independence hero monument. You will also visit explorer’s memorial, a huge rock in the suburbs of Bujumbura commemorating the meeting between Stanley and Livingstone. Overnight and Dinner at Club du Tanganyika','2019-10-25 16:54:26','2019-10-25 16:54:26'),(982,1612,'08:00','18:00','Burundi','Have breakfast and head to the source of Nile, near the Karera falls. You will enjoy the magnificent tea plantations and admire the scenic land scape.Then later visit waterfalls and after, drive to Gitega town the second town and colonial capital of Burundi. You will also visit Gitega national Museum with its collection of art crafts, Gitega city administrative offices, catholic location of Mushasha and its also different local schools. Dinner and Overnight at Helena Hotel.','2019-10-25 16:56:53','2019-10-25 16:56:53'),(983,1613,'08:00','18:00','Burundi','Have breakfast and visit the famous drum sanctuary site of Gishora-Gishora in Burundi. The site also houses two ritual drums that were never beaten. The Ruciteme and Murimirwa respectively. These two names are intimately linked to the farming vocation and also refer to fertility in the local language, the king’s characteristic. You will after visit the drum sanctuary of Gishora to explore the cultural tradition of Burundi. Have lunch at Gitega and after take a city tour around Gitega the second largest town of the country, with much colonial architecture which also hosts the national museum with its ethnographic and archeological collections. Later, have Lunch and drive to Bujumbura. Club du lac Hotel.','2019-10-25 16:58:13','2019-10-25 16:58:13'),(984,1614,'08:00','18:00','Bujumbura','Have a leisurely breakfast and proceed to the Airport for flight connections back home.','2019-10-25 16:59:05','2019-10-25 16:59:05'),(1092,1755,'06:00','18:00','Kigali','Welcome! this day at your arrival, you will be picked by our diver guide and transfer you to the Onomo Hotel for overnight and dinner.','2019-11-07 12:27:04','2019-11-07 12:27:04'),(1093,1756,'07:00','18:00','Kigali – Nyungwe National Park.','This morning we depart from Kigali to Nyungwe National Park En-route we shall visit the Old King’s Place Museum in Nyanza and National museum (Ethnographic museum) in Huye. Lunch en-route, proceed to the park. Dinner and Overnight at Nyungwe Top View Hill Hotel.','2019-11-07 12:28:52','2019-11-07 12:28:52'),(1094,1757,'05:00','18:00','Nyungwe National Park','After Breakfast, Drive to the park headquarters to be briefed about the “dos and don’ts” while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will go for the canopy walk. This is a highlight of any Nyungwe tour. Enjoy epic views of the Nyungwe forest and catch elusive wildlife in the canopies such as monkeys and birds! Dinner and Overnight at Nyungwe Top View Hill Hotel.','2019-11-07 12:30:03','2019-11-07 12:30:03'),(1095,1758,'06:00','18:00','Nyungwe National Park - Karongi','Breakfast, with your packed lunch move for a full day forest guided walk within Nyungwe Forest National Park. On this long walk, you will visit the Kamiranzovu waterfalls where you will enjoy your picnic lunch. On this walk expect to see a lot of bird species and also primates like monkeys among others. Later you will Drive to Korongi. Dinner and overnight at Moriah Hotel.','2019-11-07 12:35:26','2019-11-07 12:35:26'),(1096,1759,'07:00','18:00','Karongi - Volcanoes National Park','This Morning after breakfast, you will do a boat ride and hiking at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Musanze. The distance from Karongi to Musanze is about 187Km, which takes about 4hrs drive with no rush. Dinner and Overnight at Davinci Gorilla Lodge.','2019-11-07 12:36:14','2019-11-07 12:36:14'),(1097,1760,'07:00','18:00','Volcanoes National Park','Morning after breakfast, you will depart from your hotel to the park headquarters in Kinigi. For a briefing then at 8:00am you will come to your car and drive to the edge of the park while enjoying stunning landscapes and scenery around Volcanoes National Park. At the top of mountain, you will enjoy the best view of the Crater Lake found on Bisoke Mountain. You will descend back to the starting point where our guide will be waiting to take you back to your lodge for lunch and rest. Dinner and Overnight at Davinci Gorilla Lodge.','2019-11-07 12:37:26','2019-11-07 12:37:26'),(1099,1762,'07:00','18:00','Bwindi(Uganda) - Kigali Rwanda','Have an early breakfast and head out to the Park headquarters for a briefing before the Trekking experience. At 8am, Head out into the Park for the Gorilla Trekking experience with the park rangers and guides. The Trekking exercise can take between 1-8 hours depending on the movements of the gorillas. In the afternoon after trekking, head back to the hotel for Lunch and some relaxation. Later, drive back to Rwanda-Kigali. Dinner and Overnight at Onomo Hotel.','2019-11-07 12:40:13','2019-11-07 12:40:13'),(1100,1763,'07:00','18:00','Kigali','Mount Kigali Hiking.\r\nAfter breakfast, a visit to the top of Mt. Kigali for views of the city and the countryside. To the top of the mountain, you can perform different activities including horse ride, trail ride, zip lines. On the way back from the Hiking, you will visit Nyamirambo Women’s Center and do some shopping for your souvenir. Dinner and Overnight at Onomo Hotel.','2019-11-07 12:41:00','2019-11-07 12:41:00'),(1101,1764,'07:00','18:00','Kigali City Tour -Departure.','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, Later, after lunch drive to Kigali international Airport for your departure flight.','2019-11-07 12:47:10','2019-11-07 12:47:10'),(1112,1775,'06:00','18:00','Kigali','You will be received by G-STEP TOURS driver/guide at the Airport. Depending on your arrival time, if you arrive night time, we check into The Retreat by Heaven for a relaxation moment after the long flight.','2019-11-07 14:33:57','2019-11-07 14:33:57'),(1113,1776,'07:00','18:00','Kigali – Nyungwe National Park.','This morning we depart from Kigali to Nyungwe forest having our lunch en-route in Nyanza. We have the opportunity of exploring the King’s Palace Museum in Nyanza. After this experience, we continue our drive to Nyungwe National park head Office for our 3pm Canopy walkway (Dinner and overnight at One &Only Nyungwe House).','2019-11-07 14:54:04','2019-11-07 14:54:04'),(1114,1777,'05:00','18:00','Nyungwe National Park - Karongi','After Breakfast, Drive to the park headquarters to be briefed about the “dos and don’ts” while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will be transferred to karongi. This is a 3hrs drive from Nyungwe to Karongi where you will connect to your Hotel for relaxation.\r\n(Dinner and Overnight at Kivu Lodge).','2019-11-07 14:55:24','2019-11-07 14:55:24'),(1115,1778,'07:00','18:00','Karongi - Volcanoes National Park','Early morning after breakfast, you will do a boat ride and hiking at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch and some relaxation. Later drive to volcanoes national park. (Dinner and Overnight at Bisate Lodge).','2019-11-07 14:56:56','2019-11-07 14:56:56'),(1116,1779,'07:00','18:00','Volcanoes National Park','After early morning breakfast, you will be transferred to the park headquarters in Kinigi (Musanze)for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, will head for Lunch and some relaxation. Later drive to Gorilla Guardians Village to learn about the Rwandan culture and traditions. (Dinner and Overnight at Bisate Lodge).','2019-11-07 15:00:52','2019-11-07 15:00:52'),(1117,1780,'07:00','18:00','Musanze - Uganda','Leave the hotel at 8:00 after breakfast and drive for 50minutes from Musanze. On your arrival to the lake you explore those two lakes by doing nature walk around the shores, Bird watching, short hiking, school visit and go for boat cruise. Enjoy fishing activities, beautiful hills in the surrounding of the lake. Later drive back to Musanze for lunch before being transferred to Lake Bunyonyi Uganda. (Dinner and Overnight at Bird Nest Bunyonyi Resort).','2019-11-07 15:04:00','2019-11-07 15:04:00'),(1119,1782,'07:00','18:00','Gorilla Trekking –Batwa Experience.','Have an early breakfast and head out to the Park headquarters for a briefing before the Trekking experience. At 8am, Head out into the Park for the Gorilla Trekking experience with the park rangers and guides. The Trekking exercise can take between 1-8 hours depending on the movements of the gorillas. In the afternoon after trekking, head back to the hotel for Lunch and some relaxation. After Lunch, you will go for batwa forest experience, visit a traditional Batwa homestead and learn from the women how to prepare, cook and serve a meal. Hear ancient legends and traditional songs. Later, drive back to your hotel for Dinner and Overnight at Trackers Safari Lodge).','2019-11-07 15:07:56','2019-11-07 15:07:56'),(1120,1783,'07:00','18:00','Queen Elizabeth National Park.','After an early breakfast, proceed to Queen Elizabeth National Park.  Lunch En route, you will have the chance to drive through the Ishasha sector of Queen Elizabeth where you will watch tree climbing lions. On arrival to the Park, we shall have a short game drive and later drive to your lodge for Dinner and Overnight at Mweya Safari Lodge).','2019-11-07 15:10:57','2019-11-07 15:10:57'),(1121,1784,'07:00','18:00','Queen Elizabeth - Kazinga Channel.','Wake up early for breakfast at 6.30 and start the morning game drive at 7.00am. it is a good opportunity for great wildlife sights. Drive along the Kasenyi game trail to spot lots of elephants, buffaloes, lions, warthogs, antelopes, waterbucks and bushbucks. After more than 4 hours of great wildlife sights return to the lodge to relax and have lunch. After lunch you go for 2 hours Boat ride on the lake Kazinga channel. This is the highlight of Queen Elizabeth tour as you get a chance for the best wildlife sightings at a close range. Again expect to see lots of hippos, crocodiles, monitors lizards, buffaloes, elephants, and lots others animals that come to the kazinga channel to cool off the afternoon heat, drink water, eat fresh grass and some to take refuge from predators. (Dinner and overnight stay at Mweya Safari lodge)','2019-11-07 15:13:32','2019-11-07 15:13:32'),(1122,1785,'07:00','18:00','Queen Elizabeth - Kigali','Take your breakfast at leisure at your hotel and later be ready to drive back to Rwanda. Your guide will drop you at The Retreat by Heaven for Dinner and Overnight.','2019-11-07 15:15:03','2019-11-07 15:15:03'),(1123,1786,'07:00','18:00','Kigali City Tour -Departure.','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight.','2019-11-07 15:16:31','2019-11-07 15:16:31'),(1124,1787,'06:00','18:00','Kigali','You will be received by G-STEP TOURS driver/guide at the Airport. Depending on your arrival time, if you arrive night time, we check into Hotel des Mille Collines for a relaxation moment after the long flight.','2019-11-08 08:53:23','2019-11-08 08:53:23'),(1125,1788,'07:00','18:00','Kigali – Nyungwe National Park.','This morning we depart from Kigali to Nyungwe forest having our lunch en-route in Nyanza. We have the opportunity of exploring the King’s Palace Museum in Nyanza. After this experience, we continue our drive to Nyungwe National park head Office for our 3pm Canopy walkway (Dinner and overnight at Nyungwe Top View Hill Hotel).','2019-11-08 08:54:14','2019-11-08 08:54:14'),(1126,1789,'05:00','18:00','Nyungwe National Park - Karongi','After Breakfast, Drive to the park headquarters to be briefed about the “dos and don’ts” while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will be transferred to karongi. This is a 3hrs drive from Nyungwe to Karongi where you will connect to your Hotel for relaxation.\r\n(Dinner and Overnight at Moriah Hill Hotel).','2019-11-08 08:55:16','2019-11-08 08:55:16'),(1127,1790,'07:00','18:00','Karongi - Volcanoes National Park','Early morning after breakfast, you will do a boat ride and hiking at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying Kivu lake, you will go for lunch and some relaxation. Later drive to volcanoes national park. (Dinner and Overnight at Ingagi Park View Lodge).','2019-11-08 08:56:14','2019-11-08 08:56:14'),(1128,1791,'07:00','18:00','Volcanoes National Park','After early morning breakfast, you will be transferred to the park headquarters in Kinigi (Musanze)for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, will head for Lunch and some relaxation. Later drive to Gorilla Guardians Village to learn about the Rwandan culture and traditions. (Dinner and Overnight at Ingagi Park View Lodge)','2019-11-08 08:57:13','2019-11-08 08:57:13'),(1129,1792,'07:00','18:00','Volcanoes N.P -Uganda','Leave the hotel at 8:00 after breakfast and drive for 50minutes from Musanze. On your arrival to the lake you explore those two lakes by doing nature walk around the shores, Bird watching, short hiking, school visit and go for boat cruise. Enjoy fishing activities, beautiful hills in the surrounding of the lake. Later drive back to Musanze for lunch before being transferred to Lake Bunyonyi Uganda. (Dinner and Overnight at Bunyonyi Safari Resort).','2019-11-08 08:58:46','2019-11-08 08:58:46'),(1131,1794,'07:00','18:00','Gorilla Trekking –Batwa Forest Exp.','Have an early breakfast and head out to the Park headquarters for a briefing before the Trekking experience. At 8am, Head out into the Park for the Gorilla Trekking experience with the park rangers and guides. The Trekking exercise can take between 1-8 hours depending on the movements of the gorillas. In the afternoon after trekking, head back to the hotel for Lunch and some relaxation. After Lunch, you will go for batwa forest experience, visit a traditional Batwa homestead and learn from the women how to prepare, cook and serve a meal. Hear ancient legends and traditional songs. Later, drive back to your hotel for Dinner and Overnight at Gorilla Safari Lodge).','2019-11-08 09:03:04','2019-11-08 09:03:04'),(1132,1795,'07:00','18:00','Queen Elizabeth National Park.','After an early breakfast, proceed to Queen Elizabeth National Park.  Lunch En route, you will have the chance to drive through the Ishasha sector of Queen Elizabeth where you will watch tree climbing lions. On arrival to the Park, we shall have a short game drive and later drive to your lodge for Dinner and Overnight at Mweya Safari Lodge).','2019-11-08 09:04:42','2019-11-08 09:04:42'),(1133,1796,'07:00','18:00','Queen Elizabeth - Kazinga Channel.','Wake up early for breakfast at 6.30 and start the morning game drive at 7.00am. it is a good opportunity for great wildlife sights. Drive along the Kasenyi game trail to spot lots of elephants, buffaloes, lions, warthogs, antelopes, waterbucks and bushbucks. After more than 4 hours of great wildlife sights return to the lodge to relax and have lunch. After lunch you go for 2 hours Boat ride on the lake Kazinga channel. This is the highlight of Queen Elizabeth tour as you get a chance for the best wildlife sightings at a close range. Again expect to see lots of hippos, crocodiles, monitors lizards, buffaloes, elephants, and lots others animals that come to the kazinga channel to cool off the afternoon heat, drink water, eat fresh grass and some to take refuge from predators. (Dinner and overnight stay at Mweya Safari lodge)','2019-11-08 09:05:55','2019-11-08 09:05:55'),(1134,1797,'06:00','18:00','Queen Elizabeth N.P - Kigali','Take your breakfast at leisure at your hotel and later be ready to drive back to Rwanda. Your guide will drop you at Hotel des Mille Collines for Dinner and Overnight.','2019-11-08 09:12:16','2019-11-08 09:12:16'),(1135,1798,'07:00','18:00','Kigali City Tour -Departure.','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight.','2019-11-08 09:13:25','2019-11-08 09:13:25'),(1136,1799,'06:00','18:00','Goma','Welcome! this day at your arrival, you will be picked by our company representative in Congo, and then transfer you to your hotel in Goma for a welcome meal, briefing about tour. If time allows, take a city tour in Goma. Dinner and Overnight at Cap Kivu Hotel.','2019-11-08 10:12:24','2019-11-08 10:12:24'),(1137,1800,'06:00','18:00','Nyiragongo Hiking','After breakfast, drive to Kibati Ranger Post, where treks to the summit of Nyiragongo volcano begin. On arrival to Kibati, you will receive a briefing. Park rangers lead all treks and porters are available for hire at Kibati ranger station. The ascent up the volcano starts around 10:00am with most climbing groups reaching the summit by 5:00pm. The time required to reach the summit depends on the average fitness of each group, but typically takes 4 – 6 hours.  It is possible for fitter people to climb up and descend in one day, but the vast majority chooses to overnight in the basic accommodations available at the top (included in the permit fee) because the best time to view the lava lake is at night. Sunset at the summit of Nyiragongo. Enjoy watching, in the night, the world’s largest lava lake. Dinner and overnight at the summit of Nyiragongo Volcano in the shelter.  \r\n*Trekkers are strongly advised to bring full rain and cold weather gear (moisture-wicking base layer, sweater or fleece, jacket, rain resistant pants, long underwear, warm socks, hat, and a 0°C/32° – rated sleeping bag), good walking shoes, sun cream, etc.','2019-11-08 10:14:32','2019-11-08 10:14:32'),(1138,1801,'06:00','18:00','Nyiragongo Volcano descent - Gisenyi.','Early morning, take a visit to the lava lake, have your breakfast around 7:00 am. After breakfast, start descending the volcano and arrive back at Kibati station. The driver will pick you up at the meeting place and drive to Rwanda. At the border of Corniche, about 30 minutes later, the driver arrives at Rwanda, where the driver of Rwanda will pick you up. After completing the immigration formalities, head to your hotel in Gisenyi for lunch &rest. Dinner and Overnight at Lake Kivu Serena Hotel.','2019-11-08 10:15:25','2019-11-08 10:15:25'),(1139,1802,'06:00','18:00','Kivu Boat Ride – Nyungwe N.P.','After breakfast, you will do a boat ride on lake kivu, visit fishing activities, hot spring and a visit to coffee plants. After enjoying kivu lake, you will go for lunch before being transferred to Nyungwe National Park. The distance from Gisenyi to Nyungwe National Park it’s about 192Km and road takes about 3h51min with no rush. Arriving at Nyungwe Forest National Park, where you will Connect to your Hotel for relaxation. Dinner and Overnight at Nyugwe Top View Hill Hotel.','2019-11-08 10:17:34','2019-11-08 10:17:34'),(1140,1803,'05:00','18:00','Nyungwe National Park','After Breakfast, Drive to the park headquarters to be briefed about the “dos and don’ts” while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will go for the canopy walk. This is a highlight of any Nyungwe tour. Enjoy epic views of the Nyungwe forest and catch elusive wildlife in the canopies such as monkeys and birds! Dinner and Overnight at Nyungwe Top View Hill Hotel.','2019-11-08 10:18:43','2019-11-08 10:18:43'),(1141,1804,'06:00','18:00','Drive to Burundi-Bujumbura','After breakfast, check out from the Hotel, and drive to Bujumbura city; lunch En-route, proceed to your hotel. If time allows, take a city tour in Bujumbura. Dinner and Overnight at Club du lac Tanganyika Hotel','2019-11-08 10:19:59','2019-11-08 10:19:59'),(1143,1806,'06:00','18:00','Burundi - Rwanda','Have a relaxed full board breakfast at the hotel and later be ready to drive back to Rwanda. on your way visit the Ethnographic Museum in huye and the Royal palace museum in Nyanza. After lunch drive to Kigali. Dinner and Overnight at Kigali Serena Hotel.','2019-11-08 10:21:56','2019-11-08 10:21:56'),(1144,1807,'06:00','18:00','Kigali City Tour& Drive to Musanze.','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to volcanoes National park, where you will Connect to your Lodge for relaxation。Dinner and Overnight at Ingagi Park View Lodge','2019-11-08 10:23:34','2019-11-08 10:23:34'),(1145,1808,'06:00','18:00','Rwanda - Uganda','After breakfast, take a visit to Gorilla Guardians (ibyiwacu cultural village) to learn about the Rwandan culture and traditions, Later, after lunch, you will drive to Uganda, check-in at Bird Nest Bunyonyi Resort for Dinner and Overnight.','2019-11-08 10:25:29','2019-11-08 10:25:29'),(1146,1809,'06:00','18:00','Lake Bunyonyi – Bwindi N.P','This Morning after breakfast, you will do a boat ride and hiking on Lake Bunyonyi, visit the neighboring islands and get the history of each islands, you will also get a chase to view various birds like the grey crowned crane, red-chested sun birds and many fly catchers. After lunch you will drive to bwindi impenetrable national park. Dinner and Overnight at Gorilla Safari Lodge.','2019-11-08 10:27:13','2019-11-08 10:27:13'),(1147,1810,'07:00','18:00','Uganda Gorilla – Batwa Experience.','Have an early breakfast and head out to the Park headquarters for a briefing before the Trekking experience. At 8am, Head out into the Park for the Gorilla Trekking experience with the park rangers and guides. The Trekking exercise can take between 1-8 hours depending on the movements of the gorillas. In the afternoon after trekking, head back to the hotel for Lunch and some relaxation. After Lunch, you will go for batwa forest experience, visit a traditional Batwa homestead and learn from the women how to prepare, cook and serve a meal. Hear ancient legends and traditional songs. Later, drive back to your hotel for Dinner and Overnight at Gorilla Safari Lodge.','2019-11-08 10:29:32','2019-11-08 10:29:32'),(1148,1811,'06:00','18:00','Queen Elizabeth National Park.','After an early breakfast, drive to Queen Elizabeth National Park. You will enjoy an en route game drive en route and see animals like Elephants, Buffaloes, mongoose among so many others. After your lunch, you will for a boat ride on Kazinga channel where you will have the opportunity to see a number of water animals like the hippos, crocodiles and later go to your lodge where you will have dinner from Mweya Safari Lodge.','2019-11-08 10:34:11','2019-11-08 10:34:11'),(1149,1812,'07:00','18:00','Queen Elizabeth N.P- Kampala Town.','Rise early, for a game drive in the savanna of queen Elizabeth national park with great views of wildlife in the park. Later, return to your lodge for lunch and short rest. After lunch, you will drive to Kampala. where you will Connect to your Hotel for relaxation. Dinner and Overnight at Kampala Sheraton Hotel','2019-11-08 10:36:15','2019-11-08 10:36:15'),(1150,1813,'06:00','18:00','Kampala City Tour - Jinja.','After breakfast, you may visit places like historical and Cultural sites which include the Kasubi Tombs, Namugongo shrine and Ssezibwa fall.\r\nLater after lunch, you will drive to Jinja where you will connect to your hotel for Dinner and Overnight at Jinja Nile Resort.','2019-11-08 10:38:25','2019-11-08 10:38:25'),(1151,1814,'06:00','18:00','Kenya Lake Nakuru National Park.','After an early breakfast, proceed, to Kenya Lake Nakuru National Park situated in the Rift Valley Region. From the North to the South of Kenya the valley is lined with a series of freshwater and soda based volcanic lakes. Arrive, check-in at your lodge and spend the evening at leisure. Dinner and overnight stay at Lake Nakuru Sopa Lodge.','2019-11-08 10:40:14','2019-11-08 10:40:14'),(1152,1815,'07:00','18:00','Game Drive Lake Nakuru National Park.','You start with an early morning game drive before getting back to your lodge for breakfast. After breakfast you get more game drives. In this Park you will have time to view huge animals like Rhinos, Elephants, Lions, Hippos and flocks of flamingo birds around the lake. Return to your lodge at mid-day for lunch, relax before an evening game drive in the park. Dinner and Overnight at Lake Nakuru Sopa Lodge.','2019-11-08 10:41:57','2019-11-08 10:41:57'),(1153,1816,'06:00','18:00','Lake Nakuru N.P- Masai Mara N.P.','After breakfast, depart for the world famous Masai Mara National Reserve. Arrive at your camp for check-in and have Lunch. The camp blends in perfectly with its surrounding hillside landscape. The accent here is on the Masai people and the wealth of wildlife, Bird life, and natural flora to be found in the fabled Masai Mara Game Reserve. Enjoy an afternoon game drive around the world famous Masai Mara. Dinner and overnight stay at the Masai Mara Sopa Lodge.','2019-11-08 10:44:20','2019-11-08 10:44:20'),(1154,1817,'06:00','18:00','Game Drive Masai Mara N.P.','The whole day will be spent here exploring the hidden treasures of Masai Mara National Park. Along the game drives, expect to easily see rare animals such as Lions, Leopard, Jackals, plus many others such as Rhinos, Hippos, Crocodiles, Giraffe, Wildebeests, Zebras, Buffalo, Warthogs, Hyenas, Wild dogs, several antelope species and Elephant among others. Also expect excellent birding with over 450 Bird species identified.\r\nAfter lunch, take a cultural tour among the Masai Communities and explore more about the Masai Culture. All meals and overnight stay at Masai Mara Sopa Lodge.','2019-11-08 10:45:41','2019-11-08 10:45:41'),(1155,1818,'06:00','18:00','Masai Mara National Park - Nairobi','Have breakfast at the camp and depart for Nairobi, Kenya’s most colorful city from here you will proceed to Jomo Kenyatta International Airport for your departure flight.','2019-11-08 10:46:36','2019-11-08 10:46:36'),(1156,1819,'06:00','18:00','Goma','Welcome! this day at your arrival, you will be picked by our company representative in Congo, and then transfer you to your hotel in Goma for a welcome meal, briefing about tour. If time allows, take a city tour in Goma. Dinner and Overnight at Cap Kivu Hotel.','2019-11-08 12:40:49','2019-11-08 12:40:49'),(1157,1820,'06:00','18:00','Nyiragongo Volcano Hiking.','After breakfast, drive to Kibati Ranger Post, where treks to the summit of Nyiragongo volcano begin. On arrival to Kibati, you will receive a briefing. Park rangers lead all treks and porters are available for hire at Kibati ranger station. The ascent up the volcano starts around 10:00am with most climbing groups reaching the summit by 5:00pm. The time required to reach the summit depends on the average fitness of each group, but typically takes 4 – 6 hours.  It is possible for fitter people to climb up and descend in one day, but the vast majority chooses to overnight in the basic accommodations available at the top (included in the permit fee) because the best time to view the lava lake is at night. Sunset at the summit of Nyiragongo. Enjoy watching, in the night, the world’s largest lava lake. Dinner and overnight at the summit of Nyiragongo Volcano in the shelter.  \r\n*Trekkers are strongly advised to bring full rain and cold weather gear (moisture-wicking base layer, sweater or fleece, jacket, rain resistant pants, long underwear, warm socks, hat, and a 0°C/32° – rated sleeping bag), good walking shoes, sun cream, etc.','2019-11-08 12:41:43','2019-11-08 12:41:43'),(1158,1821,'06:00','18:00','Nyiragongo Volcano descent - Gisenyi.','Early morning, take a visit to the lava lake, have your breakfast around 7:00 am. After breakfast, start descending the volcano and arrive back at Kibati station. The driver will pick you up at the 