ime allows, take a city tour in Bujumbura. Dinner and Overnight at Club du lac Tanganyika Hotel','2019-11-08 13:48:16','2019-11-08 13:48:16'),(1183,1846,'06:00','18:00','Transfer Back to Kigali','Have a relaxed full board breakfast at the hotel and later be ready to drive back to Rwanda. on your way visit the Ethnographic Museum in huye and the Royal palace museum in Nyanza. After lunch drive to Kigali. Dinner and Overnight at Kigali Serena Hotel.','2019-11-08 13:50:18','2019-11-08 13:50:18'),(1184,1847,'07:00','18:00','Kigali City Tour - Musanze.','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to volcanoes National park, where you will Connect to your Lodge for relaxation。Dinner and Overnight at Ingagi Park View Lodge','2019-11-08 14:13:55','2019-11-08 14:13:55'),(1185,1848,'07:00','18:00','Gorilla Guardians – Lake Bunyonyi.','After breakfast, take a visit to Gorilla Guardians (ibyiwacu cultural village) to learn about the Rwandan culture and traditions, Later, after lunch, you will drive to Uganda, check-in at Bird Nest Bunyonyi Resort for Dinner and Overnight.','2019-11-08 14:15:20','2019-11-08 14:15:20'),(1186,1849,'07:00','18:00','Lake Bunyonyi – Bwindi N.P.','This Morning after breakfast, you will do a boat ride and hiking on Lake Bunyonyi, visit the neighboring islands and get the history of each islands, you will also get a chase to view various birds like the grey crowned crane, red-chested sun birds and many fly catchers. After lunch you will drive to bwindi impenetrable national park. Dinner and Overnight at Gorilla Safari Lodge.','2019-11-08 14:16:37','2019-11-08 14:16:37'),(1187,1850,'07:00','18:00','Uganda Gorilla Trekking –Batwa Forest.','Have an early breakfast and head out to the Park headquarters for a briefing before the Trekking experience. At 8am, Head out into the Park for the Gorilla Trekking experience with the park rangers and guides. The Trekking exercise can take between 1-8 hours depending on the movements of the gorillas. In the afternoon after trekking, head back to the hotel for Lunch and some relaxation. After Lunch, you will go for batwa forest experience, visit a traditional Batwa homestead and learn from the women how to prepare, cook and serve a meal. Hear ancient legends and traditional songs. Later, drive back to your hotel for Dinner and Overnight at Gorilla Safari Lodge.','2019-11-08 14:17:52','2019-11-08 14:17:52'),(1188,1851,'06:00','18:00','Queen Elizabeth National Park.','After an early breakfast, drive to Queen Elizabeth National Park. You will enjoy an en route game drive en route and see animals like Elephants, Buffaloes, mongoose among so many others. After your lunch, you will for a boat ride on Kazinga channel where you will have the opportunity to see a number of water animals like the hippos, crocodiles and later go to your lodge where you will have dinner from Mweya Safari Lodge.','2019-11-08 14:18:58','2019-11-08 14:18:58'),(1189,1852,'06:00','18:00','Game drive - Kampala Town.','Rise early, for a game drive in the savanna of queen Elizabeth national park with great views of wildlife in the park. Later, return to your lodge for lunch and short rest. After lunch, you will drive to Kampala. where you will Connect to your Hotel for relaxation. Dinner and Overnight at Kampala Sheraton Hotel','2019-11-08 14:20:38','2019-11-08 14:20:38'),(1190,1853,'06:00','18:00','Kampala City Tour-Drive to Jinja.','After breakfast, you may visit places like historical and Cultural sites which include the Kasubi Tombs, Namugongo shrine and Ssezibwa fall.\r\nLater after lunch, you will drive to Jinja where you will connect to your hotel for Dinner and Overnight at Jinja Nile Resort.','2019-11-08 14:22:10','2019-11-08 14:22:10'),(1191,1854,'06:00','18:00','Kenya Lake Nakuru National Park.','After an early breakfast, proceed, to Kenya Lake Nakuru National Park situated in the Rift Valley Region. From the North to the South of Kenya the valley is lined with a series of freshwater and soda based volcanic lakes. Arrive, check-in at your lodge and spend the evening at leisure. Dinner and overnight stay at Lake Nakuru Sopa Lodge.','2019-11-08 14:23:30','2019-11-08 14:23:30'),(1192,1855,'07:00','18:00','Lake Nakuru National Park.','You start with an early morning game drive before getting back to your lodge for breakfast. After breakfast you get more game drives. In this Park you will have time to view huge animals like Rhinos, Elephants, Lions, Hippos and flocks of flamingo birds around the lake. Return to your lodge at mid-day for lunch, relax before an evening game drive in the park. Dinner and Overnight at Lake Nakuru Sopa Lodge.','2019-11-08 14:24:58','2019-11-08 14:24:58'),(1193,1856,'06:00','18:00','Lake Nakuru N.P- Masai Mara N.P.','After breakfast, depart for the world famous Masai Mara National Reserve. Arrive at your camp for check-in and have Lunch. The camp blends in perfectly with its surrounding hillside landscape. The accent here is on the Masai people and the wealth of wildlife, Bird life, and natural flora to be found in the fabled Masai Mara Game Reserve. Enjoy an afternoon game drive around the world famous Masai Mara. Dinner and overnight stay at the Masai Mara Sopa Lodge.','2019-11-08 14:26:51','2019-11-08 14:26:51'),(1194,1857,'19:00','18:00','Masai Mara National Park','The whole day will be spent here exploring the hidden treasures of Masai Mara National Park. Along the game drives, expect to easily see rare animals such as Lions, Leopard, Jackals, plus many others such as Rhinos, Hippos, Crocodiles, Giraffe, Wildebeests, Zebras, Buffalo, Warthogs, Hyenas, Wild dogs, several antelope species and Elephant among others. Also expect excellent birding with over 450 Bird species identified.\r\nAfter lunch, take a cultural tour among the Masai Communities and explore more about the Masai Culture. All meals and overnight stay at Masai Mara Sopa Lodge.','2019-11-08 14:27:57','2019-11-08 14:27:57'),(1195,1858,'07:00','18:00','Masai Mara N.P - Nairobi','Have breakfast at the camp and depart for Nairobi, Kenya’s most colorful city from here you will proceed to Jomo Kenyatta International Airport for your departure flight.','2019-11-08 14:29:42','2019-11-08 14:29:42'),(1219,1889,'15:00','18:00','Kigali','Welcome! This day at your arrival, you will be picked by our driver guide (Company representative) and then transfer you to your hotel in Kigali for a relaxation moment after the long flight and briefing about this great adventure tour. Overnight and Dinner at a hotel in Kigali.','2019-11-12 09:53:10','2020-03-17 15:54:57'),(1220,1890,'07:00','18:00','Kigali -Nyungwe national park','After Morning breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, from here you will drive to Nyungwe forest having our lunch en-route in Huye, and proceed to Nyungwe National park head Office for our 3pm Canopy walkway. Overnight and Dinner at a hotel in Nyungwe National Park.','2019-11-12 09:53:50','2020-03-17 15:55:20'),(1221,1891,'07:00','18:00','Nyungwe National Park -Kibuye','After Breakfast, Drive to the park headquarters to be briefed about the “dos and don’ts” while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will be transferred to karongi. This is a 2hrs drive from Nyungwe National Park to Karongi where you will connect to your Hotel for relaxation. Overnight and Dinner at a hotel in Kibuye.','2019-11-12 09:54:39','2020-03-17 15:55:43'),(1222,1892,'08:00','18:00','Kibuye - Gisenyi','Early morning after breakfast, you will do a boat ride and hiking at lake Kivu\r\narriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Gisenyi. The distance from Karongi to Gisenyi is about 124Km, which takes about 3hours drive with no rush. On arriving Gisenyi, you will visit the DRC-Rwanda border (Gisenyi town). Overnight and Dinner at a hotel n Gisenyi.','2019-11-12 09:56:07','2020-03-17 15:57:30'),(1223,1893,'05:00','18:00','Gisenyi -Volcanoes National Park','After early morning breakfast or with packed breakfast, you will be transferred to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about the Rwandan culture and traditions. Overnight and Dinner  at a hotel in Musanze.','2019-11-12 09:57:27','2020-03-17 15:57:54'),(1224,1894,'06:00','18:00','Volcanoes National Park - Kigali','Early in the morning you will take breakfast at the Hotel, then drive to Volcanoes National park headquarters in kinigi for a briefing about the golden Monkeys. Along with your Packed Lunch, trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, you will drive back to Kigali international airport for your departure flight.','2019-11-12 09:58:56','2020-03-05 17:48:25'),(1273,1944,'15:00','17:00','Kigali','Welcome! this day at your arrival, you will be picked by our company representative, and then transfer you to your hotel in Kigali for a welcome meal, briefing about tour. If time allows, take a city tour in Kigali.\r\nDinner and Overnight at a hotel in Kigali.','2019-11-14 14:11:27','2020-03-17 17:25:23'),(1275,1946,'07:00','18:00','Akagera National Park','Morning after breakfast, set off for a wonderful morning game drive through the Savannah woodlands to have clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. Return to your lodge at mid-day for lunch. After lunch you will head out for an amazing canoe ride on Lake Ihema. At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. \r\nDinner and Overnight at a hotel in Akagera National Park.','2019-11-14 14:19:03','2020-03-17 17:25:50'),(1276,1947,'08:00','18:00','Akagera National Park -Kigali','This day After breakfast, we shall have yet another day of adventure within the park, enjoying the beautiful sceneries of Rwanda’s hilly landscape, comprised of a blend of wetland, savannah and woodland, the natural forests also make quite a view. With your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, you’ll continue with the game drive heading north of the park. You’ll drive back to Kigali and arrive at around 6pm. \r\nDinner and Overnight at your hotel in Kigali.','2019-11-14 14:21:13','2020-03-17 17:26:24'),(1277,1948,'08:00','18:00','Kigali -Nyungwe national park','This morning you will depart from Kigali to Huye. En-route visit the Basilica of Kabgayi, king’s palace and traditional cows in Nyanza. After lunch you will drive to huye to visit National University of Rwanda. \r\nDinner and Overnight at a hotel in Huye.','2019-11-14 14:22:58','2020-03-17 17:26:50'),(1278,1949,'08:00','18:00','Huye -Nyungwe National Park','Morning after breakfast, visit the ethnographic Museum, introduction to Rwanda’s kingdoms, discovery of colonial architecture, enjoy traditional dancers from the museum. From here you will go for lunch, after lunch drive to kanyaru border post between Rwanda and Burundi boarder to visit the Kanyuru tea plantation. Later drive to Nyungwe National Park.\r\nDinner and Overnight at a hotel in Nyungwe National Park.','2019-11-14 14:24:48','2020-03-17 17:27:28'),(1280,1951,'07:00','18:00','Nyungwe National Park','Breakfast, with your packed lunch move for a full day forest guided walk within Nyungwe Forest National Park. On this long walk, you will visit the Kamiranzovu waterfalls where you will enjoy your picnic lunch. On this walk expect to see a lot of bird species and also primates like monkeys among others. Later drive back to your hotel.\r\nDinner and Overnight at your hotel in Nyungwe National Park.','2019-11-14 14:38:59','2020-03-17 17:28:03'),(1281,1952,'07:00','18:00','Nyungwe National Park','You will have breakfast and set off with your guide to search for the Colobus monkeys in Nyungwe Forest. The forest is said to be home to the biggest troops of Angola Colobuses in the world; numbering over 400 troops. The hike to where these primates stay is a thrilling experience as the guides explain the behavior, activities and intelligence gimmicks of the primates. A walk in the forest is a whole learning experience about the botany, ornithology and ecology of the forest.\r\nDinner and Overnight at your hotel in Nyungwe National Park.','2019-11-14 14:40:04','2020-03-17 17:28:45'),(1282,1953,'08:00','18:00','Nyungwe National Park -Kibuye','After breakfast, you will go for the canopy walk. This is a highlight of any Nyungwe tour. Enjoy epic views of the Nyungwe forest and catch elusive wildlife in the canopies such as monkeys and birds!  After canopy experience you will drive back to your hotel for lunch before being transferred to karongi where you will connect to your hotel for relaxation. \r\nDinner and Overnight at a hotel in Kibuye.','2019-11-14 14:40:53','2020-03-17 17:29:29'),(1283,1954,'08:00','18:00','Kibuye -Gisenyi','Early morning after breakfast, you will do a boat ride and hiking at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Gisenyi. The distance from Karongi to Gisenyi is about 124Km, which takes about 3hours drive with no rush. On arriving Gisenyi, you will visit the DRC-Rwanda border (Gisenyi town) \r\nDinner and Overnight at a hotel in Gisenyi.','2019-11-14 14:41:49','2020-03-17 17:30:41'),(1284,1955,'08:00','18:00','Gisenyi -Volcanoes National Park','After breakfast, you will do a boat ride, visit fishing activities, hot spring water and Visit coffee plants; pick beans, entering the industry with full educational explanations of the plantation. After enjoying kivu lake, you will go for lunch, later drive to Volcanoes National Park.\r\nDinner and Overnight at a hotel in Musanze.','2019-11-14 14:42:35','2020-03-17 17:43:46'),(1285,1956,'07:00','18:00','Volcanoes National Park','After early morning breakfast, you will be transferred to the park headquarters in Kinigi for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about the Rwandan culture and traditions. \r\nDinner and Overnight at your hotel in Musanze.','2019-11-14 14:43:18','2020-03-17 17:45:24'),(1286,1957,'07:00','18:00','Volcanoes National Park','Early in the morning you will take breakfast at the Hotel, then drive to Volcanoes National park headquarters in kinigi for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, will head for Lunch and later drive to Nkotsi Village for Community activities.\r\nDinner and Overnight at your hotel in Musanze.','2019-11-14 14:44:04','2020-03-17 17:45:52'),(1287,1958,'08:00','18:00','Volcanoes National Park','Depart from the lodge at 8:00 am and start Musanze city tour accompanied with your guide. Your tour starts from the government institutions headquarters, local market, Dian Fossey exhibition center, different hotels, night clubs, bars and restaurants, residential areas, etc. After this tour you drive 5 minutes to Mukungwa River, 2km out of the town for kayaking experience. This lasts between 1 up 2 hours. After this fabulous experience you drive straight to Cyanika border approximately 35 km from Musanze town. You have your lunch at the border and come back to Musanze in the evening for overnight and relaxation.\r\nDinner and Overnight at your hotel in musanze.','2019-11-14 14:45:04','2020-03-17 17:46:19'),(1288,1959,'07:00','18:00','Volcanoes National Park','Morning after breakfast, you will depart from your hotel at 6:30 to the park headquarters in Kinigi. For a briefing then at 8:00am you will come to your car and drive to the edge of the park while enjoying stunning landscapes and scenery around Volcanoes National Park. At the top of mountain, you will enjoy the best view of the Crater Lake found on Bisoke Mountain. On your way back you have your lunch, drinks and other necessities at the foot of the mountain.\r\nDinner and Overnight at your hotel in Musanze.','2019-11-14 14:45:51','2020-03-17 17:46:43'),(1289,1960,'08:00','18:00','Volcanoes National Park - Kigali','Leave the hotel at 8:00 after breakfast and drive for 50minutes from Musanze. On your arrival to the lake you explore those two lakes by doing nature walk around the shores, Bird watching, short hiking, school visit and go for boat cruise. Enjoy fishing activities, beautiful hills in the surrounding of the lake. Later drive back to musanze for lunch before being transferred to Kigali.\r\nDinner and Overnight at your hotel in Kigali.','2019-11-14 14:46:28','2020-03-17 17:47:24'),(1290,1961,'08:00','18:00','KIGALI','After breakfast, a visit to the top of Mt. Kigali for views of the city and the countryside. To the top of the mountain, you can perform different activities including horse ride, trail ride, zip lines. On the way back from the Hiking, you will visit Nyamirambo Women’s Center and do some shopping for your souvenir.\r\nDinner and Overnight at your hotel in Kigali.','2019-11-14 14:47:08','2020-03-17 17:47:49'),(1291,1962,'08:00','18:00','Kigali - Nyamata','After breakfast, drive to Nyamata Genocide Memorial where mass killings occurred during the 1994 genocide; more than 2,500 people were killed in the church. The Nyamata Genocide Memorial is located about 35kilometers south of the capital city of Kigali. Located in the Bugasera region, In the church at Nyamata, there will be graphic and audio-visual displays that will focus particularly on the mass rape, brutalization of women and the use of HIV as a deliberate weapon of genocide. Return to the city for lunch, later you will visit Kigali Genocide Memorial Centre, Belgian peacekeepers memorial, Hotel Rwanda (Hotel des Mille Collins) Inema Arts Centre and Kimironko Market. \r\nDinner and Overnight at your hotel in Kigali.','2019-11-14 14:48:05','2020-03-17 17:48:16'),(1292,1963,'09:00','18:00','Kigali International airport','After breakfast, your guide will transfer you to Kigali International Airport for your flight back home.','2019-11-14 14:48:48','2019-11-14 14:48:48'),(1293,1964,'09:00','18:00','Kigali - Akagera Natiobal Park','You will be picked up from the Airport or the Hotel in Kigali and then drive to Akagera National Park. Driving East of Rwanda (3 hours’ drive). In the afternoon, you will head out for an amazing canoe ride on Lake Ihema. At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. Later drive to your hotel for relaxation. Dinner and Overnight at a Hotel in Akagera National Park.','2019-11-15 14:08:51','2020-03-17 10:34:40'),(1294,1965,'07:00','18:00','Akagera National Park -Kigali','Have a relaxed full board breakfast at the hotel and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc.  With your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, you’ll continue with the game drive heading north of the park. You’ll drive back to Kigali and arrive at around 6pm.','2019-11-15 14:09:57','2020-02-03 10:10:02'),(1297,1969,'05:30','18:00','Kigali - Volcanoes National Park','You will be picked up from G-STEP TOURS Office at Kisementi by your driver/guide then head to Volcanoes National park-home to the remaining mountain gorillas in the world, connect directly to the park headquarters for a briefing about the activity as early as 7am, you will then be allocated the ranger guides and you head for the hike. \r\nKarisimbi volcano is the highest of the 8 mountain peaks of Virunga conservation region (Nyiragongo and Nyamuragira volcanoes). The hike is strenuous and challenging so you need to be physically fit to do this hike. \r\n\r\nThis is a 6 hours hike with great views, different bird species and primates. On reaching at an altitude of about 3700m, you will stop at the first camping site where you will spend a night.','2019-11-18 11:13:02','2020-02-07 16:58:52'),(1298,1970,'06:00','18:00','Volcanoes National Park - Kigali','After early breakfast, embark on an hour’s hike to the summit. At this level the hike is very steep going through trials of thick jungles surrounded by a stunning scenery. \r\nOn reaching at the summit, enjoy amazing views of the surrounding areas like mount Muhabura. After enjoying your time at the summit descent to the starting point where you will meet your driver readily waiting to receive you and connect for late lunch (Self sponsored), Later embark on your journey back to Kigali city.','2019-11-18 11:14:25','2020-02-07 16:59:27'),(1309,1981,'08:00','18:00','Kigali -Nyungwe national park','You will depart from Kigali to Nyungwe forest preferably early morning after your breakfast so that we have enough time for stopover at the ethnographic museum in Huye. The journey will take us through Nyanza district and eventually Huye. The ethnographic museum which is also the national museum of Rwanda showcases the historic and cultural aspects of Rwanda through the ages. It has materials and guides to take you through the rich Rwandan culture and history. We will have lunch after the museum experience before continuing on our journey to Nyungwe forest. The roads to Nyungwe after Huye are mostly winding which will give you amazing views of the famous ‘thousand hills’. You will have dinner and rest at a hotel in Nyungwe National Park.','2019-11-21 11:06:39','2020-03-17 10:42:33'),(1310,1982,'05:00','18:00','Nyungwe National Park -Kigali','After breakfast, enjoy Bird watching whole day in the park, where there are over310 species that have been recorded in Nyungwe which reflects a large habitat diversity and the altitudinal range. These also include the 25 species of the Albertine Rift mountains endemic bird Area which occur in Rwanda, The Rockefellers’ sun bird, Chapin’s flycatcher. More so, 11 of the 23species of the Guinea Congo Forest biome and also 71 of the 74 species of this biome of the afro tropical highlands that occur in Rwanda and have been recorded at this site. Usually, Nyungwe forest is also the most vital forest for the conservation of Mountainous birds in the region. after here you will drive back to Kigali.','2019-11-21 11:08:34','2020-02-07 16:35:29'),(1311,1983,'08:00','18:00','Kigali -Volcanoes National Park','Welcome! this day at your arrival, you will be picked by our diver guide and transfer you to Gisozi Memorial site for learning more about genocide against Tutsi of 1994, and campaign against genocide. Later you will drive for about 1-2hour to the Volcanoes National Park. (Check in and Dinner at  a hotel in Kinigi - Musanze).','2019-11-21 11:29:46','2020-03-17 10:45:03'),(1312,1984,'07:00','18:00','Volcanoes National Park - Kigali','After early morning breakfast, you will be transferred to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorillas from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about the Rwandan culture and traditions,you will be dropped back to your location in Kigali.','2019-11-21 11:31:51','2020-02-07 16:57:05'),(1313,1985,'05:30','18:30','Kigali -Volcanoes National Park','You will be picked up from your location in Kigali and then drive to Musanze for Gorilla naming ceremony in Kinigi, which is an annual special day of giving Baby gorillas names, It is very enjoyable with traditional dances of Rwanda. You will have packed lunch, which you will enjoy while at the event. (This is a whole day Event). Dinner and overnight at a hotel in Musanze.','2019-11-21 12:15:46','2020-03-17 13:17:01'),(1314,1986,'06:00','18:00','Volcanoes National Park','After early morning breakfast, you will be transferred to the park headquarters in Kinigi for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your guide and a transfer for lunch. After some relaxation, head to Ibyiwacu Cultural Village where you will have a chance to learn more about the Rwandan traditions and Culture. Dinner and Overnight at a hotel in Musanze.','2019-11-21 12:16:48','2020-03-17 13:17:28'),(1315,1987,'08:00','18:00','Volcanoes National Park - Kigali','After breakfast, you will drive to Burera and Ruhondo Lakes to enjoy a fantastic nature walk around the lakes, bird watching, and later a beautiful sundowner cruise while enjoying the outstanding view of the volcanoes with cold drinks and snacks. Later in the evening, drive back to Kigali and be dropped at your desired location.','2019-11-21 12:17:39','2019-11-21 12:17:39'),(1316,1988,'08:00','18:00','Kigali -Gisenyi','You will be picked by our guide or company representative, from your hotel accommodation in Kigali or airport in case you arrive with morning flight and head for a city tour to visit the Kigali Genocide memorial ground where over 25000 bodies of victims of genocide were given a decent burial and later have lunch at Mille Collins Hotel before being transferred to GISENYI. A trip to GISENYI at lake Kivu is fantastic and pleasant way to spend some time relaxing on the water as you enjoy the little peace and quiet. The lake is lies on the border between the Democratic Republic of Congo and Rwanda and is in the Albertine (western) Rift, a part of the great Rift valley. The distance from Kigali to Lake kivu it’s about 146Km and road takes about 3hours with no rush. arriving at Gisenyi where we visit the fishing village, visit DRC-Rwanda border (Gisenyi town) and relax at the lakeside in the evening. Overnight and Dinner at a hotel in Gisenyi.','2019-11-22 09:15:59','2020-03-17 10:47:07'),(1317,1989,'05:30','19:00','Volcanoes National Park - Kigali','After an early breakfast You will be transferred to volcanoes national park. Gather at the park headquarters, attend a short briefing about hiking do and don’ts and then transfer to the hiking starting point with your packed lunch and enough drinking water. The hike takes about 3 - 4 hours to reach the summit and 2 hours to descend. You will enjoy the fresh breath at the volcano summit with spectacular views of Kigali city, neighboring countries and volcanoes national park. Later be dropped off at your preferred location in Kigali.','2019-11-22 09:18:07','2020-02-13 10:44:41'),(1318,1995,'05:00','18:00','Lake Manyara National Park','Pick up from your hotel in Arusha after breakfast, then you will be met by our driver/Guide, who will offer you a short safari information before you depart to Lake Manyara. There after travel west to the Great Rift Valley and the Lake Manyara National Park. You will travel through the agricultural and fresh produce market town of Mto Wa Mbu, which is situated next to the entrance of the Lake Manyara National Park. The town is a souvenir hunter’s paradise, harboring thousands souvenir salesmen - ready to pounce at your slightest invitation. The Lake Manyara National Park is one of Tanzania\'s most dramatically located African wildlife areas, consisting of a massive but shallow soda lake (covering two-thirds of the park) at the foot of the Great Rift Valley\'s western escarpment. The park\'s varied habitat attracts a wide variety of animals, including one of Africa\'s densely populated African elephant’s herds, Lake Manyara’s famous tree-climbing lions, as well as large flocks of flamingos, attracted by the algae in the lake. We will enjoy a picnic lunch inside the park and do two exciting morning and afternoon game drives, in search of the tree-climbing lions. Late afternoon we depart for Arusha from Lake Manyara where the adventure Safari comes to an end.','2019-12-16 10:28:18','2019-12-16 10:28:18'),(1322,2015,'13:00','18:00','Kigali - akagera Natiobal Park','You will be picked up from your Location in Kigali at 1:00pm and then drive to Akagera National Park. Driving East of Rwanda (3 hours’ drive). On arrival at the park, we shall have a short game drive. Later driver to Mutumba Campsite for spending a night, with campfire and taking your food.','2019-12-26 11:36:15','2019-12-26 11:36:15'),(1323,2016,'07:00','18:00','Akagera National Park - Kigali','Have a relaxed breakfast and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc.  With your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, you’ll continue with the game drive heading north of the park. You’ll drive back to Kigali and arrive at around 6pm.','2019-12-26 12:10:57','2019-12-26 12:10:57'),(1325,2118,'06:00','19:00','Kigali -Akagera National Park','Early Morning, you will be picked up from Kigali International Airport and then drive to Akagera national park. Where we shall do a morning game drive have a picnic lunch in the park, enjoying the beautiful sceneries of Rwanda’s hilly landscape, comprised of a blend of wattle and, savannah, and woodland, the natural forests also make quite a view. The location of the park shows that it lies at a lower altitude as compared to rest of the country, some of the wildlife you will see here include Giraffes, Buffalos, Elephants as well as a profusion of birds. If fortunate, we may be able to sight at the Shoebill Stork, especially around the shores of the lake. Later drive back to Kigali for Dinner and Overnight at a hotel in Kigali.','2020-01-08 16:22:45','2020-03-17 13:30:54'),(1326,2119,'07:00','18:00','Kigali -Gisenyi','Breakfast and drive to Gisenyi. A trip to GISENYI at lake Kivu is fantastic and pleasant way to spend some time relaxing on the water as you enjoy the little peace and quiet. The lake is lies on the border between the Democratic Republic of Congo and Rwanda and is in the Albertine (western) Rift, a part of the great Rift valley. The distance from Kigali to Lake Kivu it’s about 146Km and road takes about 3 hours with no rush. Arriving at Gisenyi where we visit the fishing village, Hot spring, visit DRC-Rwanda border (Gisenyi town). Dinner and Overnight at a hotel in Gisenyi.','2020-01-08 16:26:24','2020-03-17 13:31:24'),(1327,2120,'05:00','18:00','Volcanoes National Park - Kigali','After early morning breakfast or with your packed breakfast, you will be transferred to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-8 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. Later connect back to Kigali city. The driver will either drop you off at where you will be staying in Kigali or proceed and drop you at the airport for your flight.','2020-01-08 16:30:04','2020-01-08 16:30:04'),(1331,2125,'06:00','18:00','Kigali -Akagera National Park','You will be picked up from your Hotel in Kigali and then drive to Akagera National Park. \r\nDriving East of Rwanda (3 hours’ drive). On arrival at the park, we shall have a short game drive. From the game drive transfer to your accommodation for lunch. In the afternoon you will do a boat safari on Lake Ihema. At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. Later, return to the lodge for dinner and overnight at a hotel in Akagera National Park.','2020-01-21 13:11:18','2020-03-17 13:50:49'),(1332,2126,'06:00','19:00','Akagera National park - Musanze','Have a relaxed full board breakfast at the hotel and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. \r\nWith your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, you’ll continue with the game drive heading north of the park. And later drive  to Volcanoes National park. Overnight and dinner at a Hotel in Musanze - Kiningi.','2020-01-21 13:14:40','2020-03-17 13:51:19'),(1333,2127,'06:00','19:00','Volcanoes National Park - Gisenyi','Early in the morning you will take breakfast at the Hotel, then drive to Volcanoes National park headquarters in kinigi for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, will head for Lunch and later drive to Gisenyi. Dinner and Overnight at  a Hotel in Gisenyi.','2020-01-21 13:19:05','2020-03-17 13:52:00'),(1334,2128,'08:00','18:00','Gisenyi -Kigali','Morning after breakfast, you will go for boat ride enjoying the beautiful water, Visit Hot springs and see the amazing bird life, engage with friendly communities and do something unique in almost all of Africa. Later back to your hotel for lunch and relax, after lunch you will drive back to Kigali.','2020-01-21 13:20:29','2020-02-03 12:28:13'),(1345,2144,'05:00','18:00','Volcanoes National Park','Early morning at 5am you will be picked up from your hotel in Kigali and drive to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorillas from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. \r\nAfter lunch and if time allows, you will visit a cultural village for an experience of Rwandan Culture and traditions that include beautiful dances by the locals. This activity is optional and only a small entry ticket to the village center will be charged.\r\nAfter your experience in the Volcanoes, will drive back to Kigali.','2020-01-25 16:59:05','2020-02-12 08:38:17'),(1346,2145,'05:00','18:00','Volcanoes National Park','You will be picked up from your Hotel in Kigali and transfer to volcanoes national park. Gather at the park headquarters, attend a short briefing about hiking do and don’ts and then transfer to the hiking starting point with your packed lunch and enough drinking water. The hike takes about 3 - 4 hours to reach the summit and 2 hours to descend. You will enjoy the fresh breath at the volcano summit with spectacular views of Kigali city, neighboring countries and volcanoes national park. Later be dropped off at your preferred location in Kigali.','2020-01-25 17:57:18','2020-02-12 08:50:49'),(1347,2146,'05:30','18:00','Kigali -Akagera National Park','Early in the morning, you will be picked up from your Location in Kigali and then drive to Akagera national park, where we shall do a morning game drive, have a picnic lunch in the park, enjoy beautiful sceneries of Rwanda’s hilly landscape comprised of a blend of wetlands, Savannah, and woodland, the natural forests also provide a relaxing feeling. The location of the park shows that it lies at a lower altitude as compared to rest of the country, therefore meaning that it is not only warmer but also more drier in the dry season. Some of the wildlife expected to be seen here includes Giraffes, Buffalo\'s, Lions and Elephants as well as a profusion of birds. If fortunate, we may be able to sight at the Shoebill Stork, especially around the shores of the lake. From here you will drive back to Kigali.','2020-01-26 13:46:34','2020-02-12 08:55:03'),(1348,2147,'05:00','18:00','Kigali -Nyungwe national park','You will be picked up from your location in Kigali and then drive to Nyungwe national park. Driving South West of Rwanda (4 hours’ drive). upon arrival in Nyungwe we shall have a registration at the park entrance and later we shall be briefed about the park and the canopy walk. On the canopy walk you will see many primates like I’hoest monkeys, red tailed monkeys, many vervet monkeys, grey cheeked monkeys, olive baboons and plant species like the common Igishigishigi. After the canopy adventure we shall then hike back to the reception and drive backwards for lunch along the way as we also take a short rest. \r\nLater drive back to Kigali.','2020-01-26 15:25:48','2020-02-12 08:45:36'),(1350,2151,'13:00','18:00','Kigali -Akagera National Park','You will be picked up from the Airport and then drive to Akagera National Park. \r\nDriving East of Rwanda (3 hours’ drive). \r\nCheck-in the Hotel on arrival and have some good rest enjoying a beautiful sunset.\r\nDinner and Overnight at a hotel in Akagera National Park.','2020-02-03 17:22:12','2020-03-17 13:53:17'),(1351,2152,'08:00','18:00','Akagera National Park','Have a relaxed full board breakfast at the hotel and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. \r\nWith your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, you will head out for an amazing canoe ride on Lake Ihema. At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. Dinner and Overnight at a hotel in Akagera National Park.','2020-02-03 17:23:01','2020-03-17 13:54:03'),(1352,2153,'08:00','18:00','Akagera National Park -Kigali','Leave the hotel at 8:00am after breakfast and drive to Kigali. On arrival we shall have lunch and short rest at mille Collins hotel. Later drive to Gisozi memorial center where there are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit Sainte Famille Church. After that you will drive to Ubumwe Grande Hotel for dinner. Overnight at a hotel in Kigali.','2020-02-03 17:24:00','2020-03-17 14:36:57'),(1353,2154,'09:00','18:00','Kigali International airport','After breakfast, take a visit to some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight','2020-02-03 17:25:42','2020-02-03 17:25:42'),(1359,2160,'18:00','19:00','KIGALI','Upon arrival at Kigali Airport, you will meet your tour guide (Our company representative) and then transfer you to your Hotel in Kigali for a welcome meal, briefing about this great adventure safari. If time allows, take a city tour in Kigali.\r\n (Dinner and Overnight at a hotel in Kigali)','2020-02-05 12:14:13','2020-03-17 15:24:56'),(1360,2161,'08:00','18:00','Kigali -Nyungwe national park','Enjoy an early morning breakfast and then head South West to the verdant Nyungwe Forest \r\nNational Park via the Ethnographic museum. During a 2-hours’ drive, you will experience the culture of ancient Rwandans. After the stopover, will continue to the Uwinka overlook to be briefed and proceed with your guide to the canopy walk adventure. \r\n(Dinner and Overnight at a hotel in Nyungwe National Park)','2020-02-05 12:51:57','2020-03-17 15:29:09'),(1361,2162,'07:00','18:00','Nyungwe National Park -Kibuye','After Breakfast, Drive to the park headquarters to be briefed about the “dos and don’ts” while with the chimps before entering the forest, you will encounter the chimps and many other primates like the black and white monkeys and various bird species, and later, return to your hotel for lunch, before being transferred to Karongi. This is a 2hr50min drive from Nyungwe to Karongi where you will Connect to your Hotel for relaxation \r\n (Dinner and Overnight at a hotel in Kibuye)','2020-02-05 13:05:06','2020-03-17 15:45:06'),(1362,2163,'08:00','18:00','Kibuye -Kigali','Early morning after breakfast, you will do a boat ride at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, will drive you back to Kigali. \r\n(Dinner and Overnight at a hotel in Kigalil)','2020-02-05 14:30:13','2020-03-17 15:45:33'),(1363,2164,'09:00','18:00','KIGALI','Excursion in Kigali town, Visit the Parliament Museum Kigali (Campaign against Genocide Museum), visit the local craft market,  and late in the evening drive to Kigali International airport in time for your flight back home.','2020-02-05 14:30:57','2020-02-05 14:30:57'),(1369,2176,'13:00','18:00','Kigali - Gisenyi','You will be picked up from your hotel in Kigali (at 1pm) and then drive to Gisenyi. The distance from Kigali to Gisenyi it’s about 163Km and road takes about 3hours with no rush. Check-in the Hotel on arrival and have some good rest enjoying a beautiful sunset.Dinner and Overnight at a hotel in Gisenyi.','2020-02-14 11:32:58','2020-03-17 12:54:13'),(1370,2177,'08:00','18:00','Gisenyi- Kigali','After breakfast, you will do a boat ride at lake kivu, visit fishing activities, Coffee plants, Hot springs, visit DRC-Rwanda border (Gisenyi town) and relax at the lakeside. Later, after lunch. Drive back to your hotel in Kigali.','2020-02-14 11:36:45','2020-02-14 11:36:45'),(1371,2178,'07:00','18:00','Kigali - Volcanoes National Park','You will be picked up from your hotel in Kigali, briefed about the tour before driving to Musanze and on your way have the en-route visit to some of the genocide memorial centre and then have lunch at one of Musanze’s best restaurants.\r\n\r\nIn the Afternoon – head out for amazing canoe ride on river mukungwa later return to your hotel for dinner and overnight at a hotel in Musanze.','2020-02-14 15:17:06','2020-03-17 12:57:30'),(1372,2179,'06:00','18:00','Volcanoes National Park-Kigali','After early morning breakfast, you will be transferred to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. Later connect back to Kigali city. The driver will either drop you off at where you will be staying in Kigali or proceed and drop you at the airport for your ongoing flight back home.','2020-02-14 15:18:56','2020-02-14 15:18:56'),(1373,2180,'08:00','18:00','Gisenyi','You will be picked by our guide (company representative) from your hotel accommodation in Kigali and transfer you to GISENYI. The distance from Kigali to Lake kivu it’s about 163Km and road takes about 3hours with no rush. arriving at Gisenyi where we shall have a boat cruise at lake kivu, visit fishing activities, Coffee plants, Hot springs, visit DRC-Rwanda border (Gisenyi town) and relax at the lakeside. Later, after lunch, you will drive back to your hotel in Kigali.','2020-02-14 16:22:43','2020-02-14 16:22:43'),(1374,2181,'07:00','18:00','Karongi','Early morning, you will be picked up from your location in Kigali and drive to Kibuye. You will drive through Gitarama (Muhanga) where you will switch to RN7 strait to Kibuye. After 2 hours enjoying unparalleled Rwanda landscape, Visit Ndaba Rock, learn the history behind this rock. Children earn living to narrating the story of this legendary rock*Have your Lunch at hotel on shores of Lake Kivu while observing the calm sea-like. Take boat rides visiting Amahoro (peace in English). Amahoro Island has a small restaurant, campsite and you can swim or play volleyball. The next ride will take you to Napoleon Islands. The island features a brigade of fruits bats. After enjoying kivu lake, you will  drive back to Kigali.','2020-02-14 17:02:33','2020-02-14 17:02:33'),(1375,2182,'06:00','18:00','Kigali - Nyungwe National Park.','You will be picked up from your location in Kigali and then drive to the western province, on your way visit the Royal Palace Museum in Southern Province and later head for an en-rooted lunch in Huye.  After lunch Proceed to Nyungwe National park head Office for a canopy walk and return in the afternoon for a relaxation at your hotel.Dinner and Overnight at a hotel in Nyungwe National Park.','2020-02-14 17:51:09','2020-03-17 13:00:17'),(1376,2183,'07:00','18:00','Nyungwe National Park - Kigali','After early morning breakfast, drive to the park headquarters to be briefed about the “dos and don’ts” while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, drive back to Kigali.','2020-02-14 17:52:29','2020-02-14 17:52:29'),(1377,2183,'07:00','18:00','Nyungwe National Park - Kigali','After early morning breakfast, drive to the park headquarters to be briefed about the “dos and don’ts” while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, drive back to Kigali.','2020-02-14 17:53:51','2020-02-14 17:53:51'),(1378,2185,'07:00','18:00','Kigali - Kibuye','Early morning, you will be picked up from your location in Kigali and drive to Kibuye. On arrival we shall visit environmental Museum where we shall see Traditional herb medicine, Image of animals like, Zebras, buffaloes, Snacks, crocodile and other animals from Rwanda also relocated minerals like: aluminums, colts, wolfram among other found in Rwanda. Dinner and Overnight at a hotel in Kibuye.','2020-02-17 14:05:03','2020-03-17 13:03:18'),(1382,2190,'09:00','18:00','Kigali-Kibuye','You will be welcomed by our guide and company representative upon arrival. Depending on the time of your arrival, you will go for a short city tour by visiting The genocide memorial site before being transferred to Kibuye. Dinner and overnight stay at a hotel in Kibuye.','2020-02-17 15:41:40','2020-03-17 13:33:02'),(1383,2191,'08:00','18:00','Kibuye','Morning After breakfast, you will go for Kayaking enjoying the beautiful water, see the amazing bird life, engage with friendly communities and do something unique in almost all of Africa. Later back to your lodge for lunch and relax, after lunch have city tour in Kibuye. Dinner and Overnight at  your hotel in Kibuye.','2020-02-17 15:42:29','2020-03-17 13:33:51'),(1384,2192,'08:00','18:00','Kibuye -Kigali','After Morning breakfast, visit environmental museum where you will see traditional medicines and animals photo displays plus others.  Later have lunch before being transferred to Kigali.','2020-02-17 15:43:39','2020-02-17 15:43:39'),(1392,2006,'06:00','18:00','Arusha - Tarangire National Park','After breakfast departs to Tarangire National Park for game drive with lunch boxes. Tarangire is famous for its huge herds of elephant population. The park consists of natural vegetation mainly of Acacia woodland and giant African Baobab trees, also Tarangire has rivers and huge swamp areas that supports large number of animals during dry season. The Park comprises the Centre of an annual migration cycle. It comprises up to 3000 elephants, 25,000 wildebeest and 30,000 zebras. Full day game drive will make you speculate and enjoy the natural beauty of the Park. Late afternoon continues to Ngoro Ngoro for dinner and overnight at Ngoro Ngoro Wildlife Camp.','2020-02-26 09:36:48','2020-02-26 09:36:48'),(1393,2007,'06:00','18:00','Tarangire National Park - Ngorongoro','After breakfast, you will descend into the crater for a full game drive with lunch boxes. Descend over 600 meters into Ngoro Ngoro crater, the Breath- taking natural wonder. Ngoro Ngoro conservation Area Authority supports a gigantic diversity of animals due to yearly round water and food supply; this comprises herds of Wildebeest, Buffalo, Zebra, Hippos, African Elephants, Eland and Warthogs. The Parks is unique too due to its intense population of predators such as; Lions, Jackals, Cheetahs, Hyenas and the mysterious rarely spotted Leopard. On the Southwest corner of the crater lies Lake Magadi, a large but shallow alkaline lake, described as one of the main features of the crater. The Lake consists of a large numbers of Flamingos, Hippos and many other water birds.\r\nLate afternoon drive back to Arusha Town.','2020-02-26 09:38:45','2020-02-26 09:38:45'),(1396,2220,'15:00','18:00','KIGALI','Upon arrival at Kigali Airport, you will meet your tour guide (Our company representative). Depending on your arrival time, if you arrive evening time, you will have small City tour. Check-in and dinner at a hotel in Kigali.','2020-02-28 11:46:12','2020-03-17 17:16:46'),(1397,2221,'08:00','18:00','Kigali - Nyamata','Start historical-minded exploration of Kigali with visits to landmarks from colonial, post-independence, genocide and post-genocide times i.e. Kigali Solaire, Stade regionale, Kigali Genocide memorial site, Kandt Museum, Belgian camp. From here you will go for lunch at your hotel. In afternoon drive to bugesera to visit the reconciliation village, Nyamata and Ntarama genocide churches. Dinner and Overnight at your hotel in Kigali.','2020-02-28 11:53:00','2020-03-17 17:17:15'),(1398,2222,'07:00','18:00','Kigali - Akagera Natiobal Park','Transfer to Kirehe; visit Imigongo and practice ancient artisanry in the region, watch the waterfalls in Rusumo (Border between Tanzania and Rwanda). After that you will for lunch before being transferred to akagera national park. Dinner and Overnight at a hotel in Akagera National Park.','2020-02-28 11:59:39','2020-03-17 17:17:57'),(1399,2223,'08:00','18:00','Akagera National Park','After your breakfast, set off for a wonderful morning game drive through the savannah woodlands to have clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. Return to your lodge at mid-day for lunch. After lunch you will head out for an amazing canoe ride on Lake Ihema. At the lake, expect to view various aquatic wildlife species like hippopotamus and crocodiles among others. Dinner and Overnight at your hotel in Akagera National Park.','2020-02-28 12:43:24','2020-03-17 17:18:30'),(1400,2224,'07:00','18:00','Akagera National Park -Kigali','This day After breakfast, we shall have yet another day of adventure within the park, enjoying the beautiful sceneries of Rwanda’s hilly landscape, comprised of a blend of wetland, savannah and woodland, the natural forests also make quite a view. With your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, you’ll continue with the game drive heading north of the park. You’ll drive back to Kigali and arrive at around 6pm. Dinner and Overnight at your hotel in Kigali.','2020-02-28 12:45:37','2020-03-17 17:19:03'),(1401,2225,'08:00','18:00','Kigali - Huye','This morning you will depart from Kigali to Huye. En-route visit the Basilica of Kabgayi, king’s palace and traditional cows in Nyanza. After lunch you will drive to huye to visit National University of Rwanda. Dinner and Overnight at a hotel in Huye.','2020-02-28 12:46:21','2020-03-17 17:19:51'),(1402,2226,'08:00','18:00','Huye -Nyungwe National Park','Morning after breakfast, visit the ethnographic Museum, introduction to Rwanda’s kingdoms, discovery of colonial architecture, enjoy traditional dancers from the museum. From here you will go for lunch at your hotel before being transferred to Nyungwe head office for our3pm canopy walk way. Dinner and Overnight at a hotel in Nyungwe National Park.','2020-02-28 13:14:12','2020-03-17 17:20:17'),(1403,2227,'05:00','18:00','Nyungwe National Park','After Breakfast, Drive to the park headquarters to be briefed about the “dos and don’ts” while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will visit Gisakura Tea Factory. Dinner and Overnight at your hotel in Nyungwe National Park.','2020-02-28 13:15:29','2020-03-17 17:20:44'),(1404,2228,'07:00','18:00','Nyungwe National Park -Kibuye','Morning After break, you will visit Kamiranzovu swamp. This activity will take 1.5hours The trail has a lot of wildflowers along it and there’re non-forest birds- on the way you will have 360degrees view of the park and even see Lake Kivu in the distance. On a clear day, you can even also see the majestic Virunga Volcanoes that seem to tower over Rwanda. From here, you will be driven back to your hotel for lunch. After lunch drive to Karongi. Dinner and Overnight at a hotel in Kibuye.','2020-02-28 13:20:40','2020-03-17 17:21:11'),(1405,2229,'08:00','18:00','Kibuye -Gisenyi','Early morning after breakfast, you will do a boat ride and hiking at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Gisenyi. The distance from Karongi to Gisenyi is about 124Km, which takes about 3hours drive with no rush. On arriving Gisenyi, you will visit the DRC-Rwanda border (Gisenyi town) Dinner and Overnight at a hotel in Gisenyi.','2020-02-28 13:22:05','2020-03-17 17:21:37'),(1406,2230,'06:00','18:00','Volcanoes National Park','After early morning breakfast or with packed Breakfast, you will be transferred to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about the Rwandan culture and traditions. Dinner and Overnight at a hotel in Musanze.','2020-02-28 13:27:04','2020-03-17 17:22:09'),(1407,2231,'06:00','18:00','Volcanoes National Park','Early in the morning you will take breakfast at the Hotel, then drive  to Volcanoes National park headquarters in kinigi for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, will head for Lunch and later drive to Nkotsi Village for Community activities. Dinner and Overnight at your hotel in Musanze.','2020-02-28 13:28:16','2020-03-17 17:23:14'),(1408,2232,'07:00','18:00','Volcanoes National Park','Morning after breakfast, you will depart from your hotel at 6:30 to the park headquarters in Kinigi. For a briefing then at 8:00am you will come to your car and drive to the edge of the park while enjoying stunning landscapes and scenery around Volcanoes National Park. At the top of mountain, you will enjoy the best view of the Crater Lake found on Bisoke Mountain. On your way back you have your lunch, drinks and other necessities at the foot of the mountain. Dinner and Overnight at your hotel in Musanze.','2020-02-28 13:29:50','2020-03-17 17:23:46'),(1409,2233,'08:00','18:00','Volcanoes National Park - Kigali','Leave the hotel at 8:00 after breakfast and drive for 50minutes from Musanze. On your arrival to the lake you explore those two lakes by doing nature walk around the shores, Bird watching, short hiking, school visit and go for boat cruise. Enjoy fishing activities, beautiful hills in the surrounding of the lake. Later drive back to musanze for lunch before being transferred to Kigali. Dinner and Overnight at your hotel in Kigali.','2020-02-28 13:35:08','2020-03-17 17:24:16'),(1410,2234,'09:00','18:00','Kigali International airport','Souvenir shopping in local handcraft at kimironko markets and transfer to the airport for your departure flight.','2020-02-28 13:36:02','2020-02-28 13:36:02'),(1412,2236,'09:30','18:00','Kigali City','You will be picked up from Grand Legacy Hotel  and then drive through the city, take a visit to Kigali Memorial Center where there are 250,000 people killed and buried in the mass grave during the Rwanda Genocide against the Tutsi. Then after proceed to the Hotel des Mille Collines for lunch and short rest, after lunch visit, Some High End Hotels in Kigali , Visit,Camp Kigali Belgian memorial, where ten of the Belgian UN blue beret soldiers were massacred during the 1994 Rwandan genocide, the soldiers were deployed to guard the prime minister Uwilingimana Agatha under the command of General Dallaire. ... Today there are ten stone columns you find here mark the spot where all 10 Belgian UN peacekeepers were murdered on the first day of the genocide. Each stone column represents one of the soldiers and the horizontal cuts in it represent the soldier’s age.Then after proceed to Campaign Against Genocide Museum. CAG Museum depicts in details how the Campaign Against Genocide Plan was executed by RPF/A following the withdrawal of UN troops leaving the targeted Tutsi under the mercy of the Genocidaires and how only the RPF/A forces who were in the war of liberation took the unilateral decision to stop Genocide, Rescue victims of Genocide and defeat the Genocidal forces. This CAG Museum also has its outer part comprised of monuments including that of the 12.7mm Machine Gun that helped in containing the advancing genocidal forces. Thereafter, visit some Local markets where you will have a chance to bargain as locals do and test to African foods such as fruits and drinks.Thereafter, you will be dropped back to Grand Legacy Hotel.','2020-03-03 08:49:37','2020-03-03 08:49:37'),(1414,2240,'09:00','12:30','Kigali City','At 9:00 am Picked up from Kigali Convention Center and then drive through the city, take a visit to Kigali Memorial Center where there are 250,000 people killed and buried in the mass grave during the Rwanda Genocide against the Tutsi. Then after proceed to the camp Kigali Belgian memorial, where ten of the Belgian UN blue beret soldiers were massacred during the 1994 Rwandan genocide, the soldiers were deployed to guard the prime minister Uwilingimana Agatha under the command of General Dallaire. ... Today there are ten stone columns you find here mark the spot where all 10 Belgian UN peacekeepers were murdered on the first day of the genocide. Each stone column represents one of the soldiers and the horizontal cuts in it represent the soldier’s age. From here you will drive to Campaign Against Genocide Museum. CAG Museum depicts in details how the Campaign Against Genocide Plan was executed by RPF/A following the withdrawal of UN troops leaving the targeted Tutsi under the mercy of the Genocidaires and how only the RPF/A forces who were in the war of liberation took the unilateral decision to stop Genocide, Rescue victims of Genocide and defeat the Genocidal forces. This CAG Museum also has its outer part comprised of monuments including that of the 12.7mm Machine Gun that helped in containing the advancing genocidal forces. Thereafter, visit some Local markets where you will have a chance to bargain as locals do and test to African foods such as fruits and drinks. Later, you will be dropped back to Kigali Convention Center.','2020-03-03 15:16:25','2020-03-03 15:16:25'),(1415,2241,'13:00','17:00','Kigali City','At 1:00 Pm Picked up from Kigali Convention Center and then drive through the city, take a visit to Kigali Memorial Center where there are 250,000 people killed and buried in the mass grave during the Rwanda Genocide against the Tutsi. Then after proceed to the camp Kigali Belgian memorial, where ten of the Belgian UN blue beret soldiers were massacred during the 1994 Rwandan genocide, the soldiers were deployed to guard the prime minister Uwilingimana Agatha under the command of General Dallaire. ... Today there are ten stone columns you find here mark the spot where all 10 Belgian UN peacekeepers were murdered on the first day of the genocide. Each stone column represents one of the soldiers and the horizontal cuts in it represent the soldier’s age. From here you will drive to Campaign Against Genocide Museum. CAG Museum depicts in details how the Campaign Against Genocide Plan was executed by RPF/A following the withdrawal of UN troops leaving the targeted Tutsi under the mercy of the Genocidaires and how only the RPF/A forces who were in the war of liberation took the unilateral decision to stop Genocide, Rescue victims of Genocide and defeat the Genocidal forces. This CAG Museum also has its outer part comprised of monuments including that of the 12.7mm Machine Gun that helped in containing the advancing genocidal forces. Thereafter, visit some Local markets where you will have a chance to bargain as locals do and test to African foods such as fruits and drinks. Later, you will be dropped back to Kigali Convention Center.','2020-03-03 15:50:27','2020-03-03 15:50:27'),(1416,2242,'17:00','22:00','Kigali City','You will be picked up from Kigali Convention Center at 5 pm  and then drive through the city, take a visit to the camp Kigali Belgian memorial, where ten of the Belgian UN blue beret soldiers were massacred during the 1994 Rwandan genocide, the soldiers were deployed to guard the prime minister Uwilingimana Agatha under the command of General Dallaire. ... Today there are ten stone columns you find here mark the spot where all 10 Belgian UN peacekeepers were murdered on the first day of the genocide. Each stone column represents one of the soldiers and the horizontal cuts in it represent the soldier’s age.Then after proceed to nyamirambo city, visit  some craft shops , you will head for the most beautiful Rwandan Traditional dances where you’ll also be served Dinner. \r\nAfter enjoying your dinner and Cultural Dances, you will be dropped back to Kigali Convention Center.','2020-03-03 18:04:25','2020-03-03 18:25:38'),(1417,2243,'05:30','19:00','Nyungwe National Park','You will be picked up from your location in Kigali and then drive to Nyungwe national park. Driving South West of Rwanda (4 hours’ drive). upon arrival in Nyungwe we shall have a registration at the park entrance and later we shall be briefed about the park and the canopy walk. On the canopy walk you will see many primates like I’hoest monkeys, red tailed monkeys, many vervet monkeys, grey cheeked monkeys, olive baboons and plant species like the common Igishigishigi. After the canopy adventure we shall then hike back to the reception and drive backwards for lunch along the way as we also take a short rest. \r\nLater drive back to Kigali.','2020-03-04 11:44:54','2020-03-04 11:44:54'),(1418,2244,'05:30','18:00','Akagera National Park','Early in the morning, you will be picked up from your Location in Kigali and then drive to Akagera national park, where we shall do a morning game drive, have a picnic lunch in the park, enjoy beautiful sceneries of Rwanda’s hilly landscape comprised of a blend of wetlands, savannah, and woodland, the natural forests also provide a relaxing feeling. The location of the park shows that it lies at a lower altitude as compared to rest of the country, therefore meaning that it is not only warmer but also more drier in the dry season. Some of the wildlife expected to be seen here includes Giraffes, Buffalo\'s, Lions and Elephants as well as a profusion of birds. If fortunate, we may be able to sight at the Shoebill Stork, especially around the shores of the lake. From here you will drive back to Kigali.','2020-03-04 12:13:54','2020-03-04 12:13:54'),(1419,2245,'05:00','17:00','Volcanoes National Park','Early morning at 5am you will be picked up from your hotel in Kigali and drive to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorillas from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. \r\nAfter lunch ,will drive back to Kigali.','2020-03-04 12:39:09','2020-03-04 12:39:09'),(1420,2246,'22:00','18:00','Kigali -Akagera National Park','You will be picked up from the Airport and then drive to Akagera National Park. Driving East of Rwanda (3 hours’ drive) Check-in the Hotel on arrival and have some good rest enjoying a beautiful sunset. Overnight and Dinner at a hotel in Akagera National Park.','2020-03-05 15:56:37','2020-03-17 15:58:56'),(1421,2247,'06:00','18:00','Akagera National Park -Kigali','Have a relaxed full board breakfast at the hotel and set off for a wonderful morning game drive through the savannah woodlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. \r\nWith your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, you’ll continue with the game drive heading north of the park. You’ll drive back to Kigali and arrive at around 6pm. Overnight and Dinner at a hotel in Kigali.','2020-03-05 15:58:13','2020-03-17 15:59:17'),(1422,2248,'07:00','18:00','Kigali -Nyungwe national park','This morning we depart from Kigali to Nyungwe forest having our lunch en-route in Huye. We have the opportunity of exploring the Ethnographic Museum in Huye. After this experience, we continue our drive to Nyungwe National park head Office for our 3pm Canopy walkway. Overnight and Dinner at a hotel in Nyungwe National Park.','2020-03-05 16:00:03','2020-03-17 15:59:50'),(1423,2249,'07:00','18:00','Nyungwe National Park -Kibuye','After Breakfast, Drive to the park headquarters to be briefed about the “dos and don’ts” while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. 