24'),(1457,2288,'07:00','18:00','Nyungwe National Park','After an early breakfast will drive you to the park headquarters to be briefed about the “dos and don’ts” while with the chimps before entering the forest. You will encounter the chimps and many other primates like the black and white monkeys and various bird species. After Lunch Visit Gisakura Tea factory. Dinner and overnight at a hotel in Nyungwe National Park.','2020-03-05 19:57:29','2020-03-17 16:31:43'),(1458,2289,'08:00','18:00','Nyungwe National Park -Kibuye','At 700hrs depart Nyungwe forest to Kibuye. The drive is about 1hr with breathtaking hilly view of the land of the thousand hills. On arriving Kibuye, you will go for lunch. After lunch do an evening boat ride and hiking at Lake Kivu. Dinner and Overnight at a hotel in Kibuye.','2020-03-05 19:58:37','2020-03-17 16:32:05'),(1459,2290,'07:00','18:00','Kibuye -Gisenyi','At 700hrs depart Nyungwe forest to Kibuye. The distance from Karongi to Gisenyi is about 124Km, which takes about 3hours drive with no rush. On arriving Gisenyi, you will visit the DRC-Rwanda border (Gisenyi town). After lunch visit Hot springs. Dinner and Overnight at a hotel in Gisenyi.','2020-03-05 20:00:38','2020-03-17 16:32:47'),(1460,2291,'06:00','18:00','Volcanoes National Park','after an early breakfast at your hotel as you prepare for a thrilling experience while gorilla trekking. To the Headquarters of Kinigi with packed lunch, water plus a light rain jacket for a briefing about the gorilla trekking escapade. In this briefing you will be advised on how you should handle yourself on finding the gorilla, what to carry with you for the trekking and among these will be trekking-boots because the track takes you along the steep slippery grounds in the heart of the forests. The activity of Gorilla trekking is somewhat fatiguing and frustrating however very rewarding when you finally come face to face with these gentle apes. You will be permitted to spend an hour in their presence, taking photos and observing there very impressive way of living. After gorilla trekking drive about 1hour to Burera and Ruhondo Lakes to enjoy a fantastic boat cruise. Dinner and Overnight at a hotel in Musanze.','2020-03-05 20:01:48','2020-03-17 16:33:14'),(1461,2292,'06:00','18:00','Volcanoes National Park - Kigali','This morning after quick breakfast, you will be at Kinigi reception for breathing about Golden monkeys in Rwanda live in the bamboo vegetation towards the base of the volcanoes and habituation has helped them to overcome their initial shyness to accept their daily visit by researchers and tourists. They are very active creatures, and jump from tree to tree which is really interesting and a little difficult to photograph! The golden monkey trek is worth going for while in Volcanoes National Park and if you’re interested in wildlife, this is a rare and delightful experience not to be missed!  Later return to your lodge for lunch and relax. after lunch drive to Kigali.  Dinner and Overnight at a hotel in Kigali.','2020-03-05 20:02:55','2020-03-17 16:33:36'),(1462,2293,'06:00','18:00','Kigali -Akagera National Park','After a morning breakfast Drive to Akagera National park for an evening boat tour on Lake Ihema. Expect to see aquatic animals such as Hippos, lions, Crocodiles as well as water birds like the papyrus gonolek, shoebill stork, and African fish eagle.  Dinner and Overnight at a hotel in Akagera National Park.','2020-03-05 20:03:42','2020-03-17 16:34:16'),(1463,2295,'09:00','18:00','KIGALI','Excursion in Kigali town, Visit the local craft market and late in the evening drive to Kigali International airport in time for your flight back home.','2020-03-05 20:04:25','2020-03-05 20:04:58'),(1464,2294,'07:00','18:00','Akagera National Park -Kigali','After a morning breakfast enjoy a game drive in akagera national park. Expect to encounter some members of the big five including the hippos, elephants, buffaloes, etc.; waterbucks and different antelope species. from here will drive back to Kigali. dinner and overnight at a hotel in Kigali.','2020-03-05 20:05:32','2020-03-17 16:34:44'),(1465,2296,'15:00','18:00','KIGALI','together with your driver / guide and depending on the time of your arrival, you will go for a short city tour within Kigali and visit the Kigali genocide memorial site. Dinner and overnight stay at a hotel in Kigali.','2020-03-05 20:24:39','2020-03-17 17:01:56'),(1466,2297,'08:00','18:00','Kigali -Volcanoes National Park','Enjoy breakfast and enjoy another stroll around Kigali city where you will visit the Kimironko market and mingle with the locals and after transfer to Ruhengeri in the Northern Province driving on a smooth tarmac road. The park is well known for its rare mountain gorillas making Gorilla trekking the major tourism activity. Arrive Ruhengeri late afternoon and transfer to your lodge for dinner and overnight at a hotel in Musanze.','2020-03-05 20:25:22','2020-03-17 17:02:21'),(1467,2298,'06:00','18:00','Volcanoes National Park','After early morning breakfast or with packed Breakfast, you will be transferred to the park headquarters in Kinigi (Musanze) for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about the Rwandan culture and traditions. Dinner and Overnight at a hotel in Musanze.','2020-03-05 20:26:09','2020-03-17 17:02:39'),(1468,2299,'06:00','18:00','Volcanoes National Park','Early in the morning you will take breakfast at the Hotel, then drive for less than 21minutes to Volcanoes National park headquarters in kinigi for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, will head for Lunch later drive to Nkosti Village (Red Rocks) for community activities on which include; Basket weaving, V Bee Keeping, Drumming Lessons. Dinner and Overnight at a hotel in Musanze.','2020-03-05 20:26:54','2020-03-17 17:03:05'),(1469,2300,'08:00','18:00','Volcanoes National Park - Gisenyi','After breakfast, you will drive to Burera and Ruhondo Lakes to enjoy a fantastic nature walk around the lakes, bird watching, and later a beautiful sundowner cruise while enjoying the outstanding view of the volcanoes with cold drinks and snacks. Later in the evening, drive to Gisenyi for relaxation. Dinner and Overnight at a hotel in Gisenyi.','2020-03-05 20:27:35','2020-03-17 17:03:40'),(1470,2301,'08:00','18:00','Gisenyi -Nyungwe National Park','This morning after breakfast you will be at Lake Kivu belt, enjoying sea sun and sand, from there you will do boat ride where you will visit some islands in biggest lake of Rwanda, like Napoleon island, Amahoro(Peace) island and star island where you wound some primates. From there after lunch you will back from lunch then later drive to Nyungwe National Park. Dinner and Overnight at a hotel in Nyungwe National Park.','2020-03-05 20:28:34','2020-03-17 17:04:19'),(1471,2302,'07:00','18: