odlands to have a clear glimpse of various wildlife species among which include the hyenas, lions, Impalas, buffaloes, elephants, zebras etc. \r\nWith your parked Lunch, have a picnic at the Hippo Beach at around mid-day. After a short rest, you’ll continue with the game drive heading north of the park. You’ll drive back to Kigali and arrive at around 6pm.\r\nDinner and Overnight at a hotel in Kigali.','2020-03-05 20:33:23','2020-03-17 17:13:29'),(1476,2307,'09:00','18:00','KIGALI','Have breakfast and transfer to the airport for your departure flight.','2020-03-05 20:33:54','2020-03-05 20:33:54'),(1477,2308,'03:00','18:00','KIGALI','Upon arrival at Kigali Airport, you will meet your tour guide (Our company representative) and then transfer you to your Hotel in Kigali for a welcome meal, briefing about this great adventure safari. If time allows, take a city tour in Kigali.  Dinner and Overnight stay at Grand Legacy Hotel.','2020-03-06 10:11:53','2020-03-06 10:11:53'),(1478,2309,'05:00','18:00','Kigali -Volcanoes National Park','After early morning breakfast, you will be transferred to the park headquarters in Kinigi for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear, drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-8 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch and refresh at your lodge. After lunch take a visit to Ibyiwacu cultural village. Dinner and overnight at Mountain Gorilla View Lodge.','2020-03-06 10:14:31','2020-03-06 10:14:31'),(1479,2310,'06:00','18:00','Volcanoes National Park - Kibale','Be up at 6.30am for breakfast, check out of Mountain Gorilla View lodge and drive to Uganda The drive takes you crossing the border Kibale takes approximately 6 hours. This is a scenic drive through the Kigezi highlands commonly known as the “Switzerland of Africa”. Overnight stay at Crater Safari Lodge.','2020-03-06 10:15:23','2020-03-06 10:15:23'),(1480,2311,'07:00','18:00','Kibale National Park - Queen elizabeth','At 7.00 am local time assemble park headquarters for the briefing from the senior park ranger and at 8.00 am your guide will transfer you to the starting point for chimpanzee tracking. Normally the whole activity takes less than 4 hours. Later the guide will lead you to Lodge for lunch. In the afternoon enjoy a nature walk in the Bigodi community Sanctuary anticipating a variety of forest birds and primates including different monkey species.\r\nIn the evening transfer to Queen Elizabeth national park. It takes 2 hours to get to Queen Elizabeth national park. Dinner and Overnight stay at Mweya Safari Lodge.','2020-03-06 10:21:53','2020-03-06 10:21:53'),(1481,2312,'07:00','18:00','Queen Elizabeth National Park','After breakfast do a morning game drive anticipating early risers including predators and other nocturnal mammals before they retreat to their hideouts. Expect mammals including hippos, buffaloes, hartebeests, leopard, lions, etc and a plethora of both endemic and migratory birds. Return to the lodge for lunch. After lunch transfer to the Kazinga Channel for a boat cruise. The Channel is a magnet to all wildlife in this park. It boasts of a big number of birds than any single destination in Africa. Retire to your lodge for relaxation. Overnight stay at Mweya Safari Lodge.','2020-03-06 10:22:43','2020-03-06 10:22:43'),(1482,2313,'09:00','18:00','KIGALI','After breakfast, proceed to Kigali.','2020-03-06 10:25:01','2020-03-06 10:25:01'),(1483,2314,'15:00','18:00','Entebbe International Airport','Upon arrival at Entebbe Airport, you will meet your tour guide (Our company representative) and then transfer you to your Hotel for a welcome meal, briefing about this great adventure Tour If time allows, take a city tour. Dinner and Overnight at the Jinja Nile Resort Hotel.','2020-03-06 12:08:00','2020-03-06 12:08:00'),(1484,2315,'08:00','18:00','Kampala','After breakfast, take a boat ride to the source of the Nile a-quite beautiful place, filled with palm trees and fantastic tropical plants. You will take a Boat ride to the actual source of the river Nile and beyond the lake where you will take pictures e for future memories, after transfer to Kampala for lunch, after lunch you will visit Gaddafi Mosque, King’s Parliament, Kassubi Museum. Dinner and Overnight at Kampala Sheraton Hotel.','2020-03-06 12:08:47','2020-03-06 12:08:47'),(1485,2316,'06:00','18:00','Queen Elizabeth National Park','After breakfast, drive to Queen Eliza Elizabeth National Park, pass to the Equator Scenic Area and take a photo (about 10 minutes). Arriving at Queen Elizabeth National Park, you will go for a 2 hours Boat ride on the Kazinga channel. This is the highlight of Queen Elizabeth tour as you get a chance for the best wildlife sightings at a close range. Expect to view lots of hippos, crocodiles, monitor lizards, buffaloes, elephants, and lots others animals that come to channel to cool off the afternoon heat, drink water, eat fresh grass and some to take refuge from predators. The channel also has a concentration of bird species. Dinner and Overnight at Mweya Safari Lodge.','2020-03-06 12:10:30','2020-03-06 12:10:30'),(1486,2317,'06:30','18:00','Queen Elizabeth National Park - Mbwindi','Be up for breakfast at 6.30 and start the morning game drive at 7.00am. it’s a good opportunity for great wildlife sights. Drive along the Kasenyi game trail and see elephants, buffaloes, lions, warthogs, antelopes, waterbucks and bushbucks.\r\nAfter more than 4 hours of great wildlife sights, return to the lodge for a relaxation and have lunch. After lunch Drive to Bwindi National park. overnight and Dinner at Icumbi Gorilla Lodge.','2020-03-06 12:11:45','2020-03-12 16:31:08'),(1487,2318,'06:00','18:00','Bwindi Impenetrable National Park','Be up by 6.00am for breakfast, grab our lunch and drive to the park offices, you will join other trekkers for gorilla trekking briefing by your guide/ranger. The gorilla trekking expedition starts at around 8am.  After a few minutes to several hours depending how fast you locate your assigned gorilla family, you will be able to enjoy your moment with the amazing Gorillas. After the gorilla experience you will go for BATWA CULTRAL EXPERIENCE, visit a traditional Batwa homestead and learn from the women how to prepare, cook and serve a meal. Hear ancient legends and traditional songs. Dinner and Overnight at Icumbi Gorilla Lodge.','2020-03-06 12:15:40','2020-03-12 16:31:58'),(1488,2319,'06:00','18:00','Bwindi  National Park  - Kigali (Rwanda)','Be up at 6.00am for breakfast, check out of Icumbi Gorilla Lodge and drive to Rwanda via the Cyanika boarder and continue to Twin Lakes, overlooking the twin lakes (about 30 minutes), Later Drive to Gisenyi for Dinner and Overnight at Kivu Serena Hotel.','2020-03-06 12:17:28','2020-03-12 16:32:42'),(1489,2320,'08:00','18:00','Nyungwe National Park','After breakfast, we shall enjoy a boat cruise to visit the nearby Islands and hot springs thereafter, we return the land and transfer to Nyungwe forest which is made up of a variety of habitats including montane forests, bamboos, grasslands, and swamps. This is a home to 13 primate species such as Chimpanzees, endangered Golden monkeys, Blue Monkeys, colobus, red tailed monkey. There are also about 300 bird species. Relax in the evening as we wait for dinner and overnight at Nyungwe top view hotel.','2020-03-06 12:22:45','2020-03-06 12:22:45'),(1490,2321,'07:00','18:00','KIGALI','Morning After breakfast, you will go for canopy walk adventure. This canopy walk takes close to 2 hours and its starting and end point being Nyungwe National park headquarters- the Uwinka tourist reception center. The first 200m is a walk Along the forest trail under the thick canopies for an opportunity of viewing the ground level nature.  *Before taking on the canopy walk way to get to the top level of the forest. The prominent sightings here include; the monkeys, including the blue monkeys, Lhotse’s monkeys, black and white colobus, the red tailed monkeys and the birds. *The minimum age for this walk is 6years and the kids must be escorted by the adults. *Remember to carry a rain coat. The hiking shoes are also vital and both of these can be rented from the reception center*The walking sticks are provided free of charge. You will later be dropped at Kigali International airport to catch up with your departure flight.','2020-03-06 12:25:05','2020-03-06 12:25:05'),(1491,2322,'15:00','18:00','Uganda -Entebbe','Upon arrival at Entebbe Airport, you will meet your tour guide (Our company representative) and then transfer you to your Hotel for a welcome meal, briefing about this great adventure tour. Overnight and Dinner at Jinja Nile Resort.','2020-03-06 17:03:34','2020-03-06 17:03:34'),(1492,2323,'08:00','18:00','Kampala','After breakfast, take a boat ride to the source of the Nile a-quite beautiful place, filled with palm trees and fantastic tropical plants. You will take a Boat ride to the actual source of the river Nile and beyond the lake where you will take pictures for future memories. After lunch you will drive to Kampala where you will visit Gaddafi Mosque, Uganda Museum and Kassubi Museum. Overnight and Dinner at Kampala Golf Course Hotel.','2020-03-06 17:08:11','2020-03-06 17:08:11'),(1493,2324,'06:00','18:00','Kibale National Park','After breakfast, you will drive you to Kibale National Park, this park is located in the southern part of Uganda and it’s a rain forest park covering a size of 766km2 with an altitude of 1,100 to 1600m above sea level. \r\n\r\nAlong the way, you will stop at the equator to enjoy some photos and also have your lunch at Mbarara town, after proceed to the park arriving in the afternoon, check in at your lodge and after the park ranger will accompany you to the park in order to enjoy a guided nature walk. You will have a chance to view many animal species like the elephants, monkeys, birds and many more. Later after the nature walk, return to the lodge for relaxation. Overnight and Dinner at Kibale Safari Camp.','2020-03-06 17:10:20','2020-03-06 17:10:20'),(1494,2325,'07:00','18:00','Kibale -Queen Elizabeth National Park','After breakfast, you will be transferred to the park headquarters for the briefing from the senior park ranger and at 8.00 am your guide will transfer you to the starting point for chimpanzee tracking. Normally the whole activity takes less than 4 hours. Later the guide will lead you to Lodge for lunch. In the afternoon transfer to Queen Elizabeth national park. It takes 2 hours to get to Queen Elizabeth national park. Overnight and Dinner Park View Safari Lodge.','2020-03-06 17:19:09','2020-03-06 17:19:09'),(1495,2326,'06:30','18:00','Queen Elizabeth National Park','Wake up early for breakfast at 6.30am and start the morning game drive at 7.00am. it is a good opportunity for great wildlife sights. Drive along the Kasenyi game trail to spot lots of elephants, buffaloes, lions, warthogs, antelopes, waterbucks and bushbucks. After more than 4 hours of great wildlife sights return to the lodge to relax and have lunch. After lunch you go for 2 hours Boat ride on the lake Kazinga channel. This is the highlight of Queen Elizabeth tour as you get a chance for the best wildlife sightings at a close range. Again expect to see lots of hippos, crocodiles, monitors lizards, buffaloes, elephants, and lots others animals that come to the Kazinga channel to cool off the afternoon heat, drink water, eat fresh grass and some to take refuge from predators. Overnight and Dinner at  Park View Safari Lodge.','2020-03-06 17:20:42','2020-03-06 17:20:42'),(1496,2327,'07:00','18:00','Queen Elizabeth National Park  - Musanze','Have breakfast at leisure and embark on your journey to Rwanda crossing through Cyanika or Katuna boarder and arriving Musanze in the afternoon. Overnight and Dinner at Mountain Gorilla View Lodge.','2020-03-06 17:21:39','2020-03-06 17:23:21'),(1497,2328,'06:30','18:00','Volcanoes National Park','After early morning breakfast, you will be transferred to the park headquarters in Kinigi for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about the Rwandan culture and traditions. Overnight and Dinner at Mountain Gorilla View Lodge.','2020-03-06 17:22:46','2020-03-06 17:22:46'),(1498,2329,'06:30','18:00','Volcanoes National Park - Kigali','Early in the morning you will take breakfast at the Hotel, then drive to Volcanoes National park headquarters in Kinigi for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, will head for Lunch and later drive to Kigali. Overnight and Dinner at Hotel des Mille Collines.','2020-03-06 17:24:26','2020-03-06 17:24:26'),(1499,2330,'09:00','18:00','KIGALI','After breakfast, take a visit to Kigali Memorial Center. There are 250,000 people killed and buried in this mass grave during the Rwanda Genocide against the Tutsi, visit some craft shops and buy for yourself a souvenir. After lunch drive to Kigali international Airport for your departure flight.','2020-03-06 17:25:14','2020-03-06 17:25:14'),(1500,2331,'15:00','18:00','Rwanda','You will be received by G-STEP TOURS driver/guide at the Airport, and drive north-wards through the beautiful terraced hillsides that characterize much of Rwanda\'s landscape, gradually climbing to the base of the awesome volcanoes with about five peaks visible. It is just 2-3 hours’ drive from Kigali. Settle into Mountain Gorilla View Lodge for dinner and overnight.','2020-03-09 10:14:21','2020-03-09 10:14:21'),(1501,2332,'06:00','18:00','Volcanoes National Park','Wake-up early and prepare yourself for today’s incredible experience of gorilla tracking. \r\nYou will transfer to Kinigi Headquarters for briefing about Gorilla tracking. You are advised to wear trekking boots because tracking goes through steep and slippery jungle grounds of the forest. Gorilla tracking is strenuous and tiresome but meeting and staying with these giant apes is worth the effort. You will be allowed to stay with gorillas for 1 hour for observation and photographing.  Later return to your Hotel for lunch and relax. In Evening you will take Community walk around the area.Later Drive to Kigali city  dinner and overnight at Kigali Serena Hotel.','2020-03-09 10:14:57','2020-03-12 10:45:14'),(1502,2333,'09:00','12:00','Kigali - Nariobi','Depart for Kigali after breakfast and depending on our flight schedule, we can take a city tour in Kigali, visit the genocide memorial sites, art and crafts shops and local markets, do shopping and later proceed to the airport for your flight to Nairobi. Dinner and Overnight in Hilton Hotel.','2020-03-09 10:16:04','2020-03-09 10:16:04'),(1503,2334,'06:00','18:00','Masai Mara National Park','Have breakfast and hit the road across the Great Rift Valley, where traditional Masai settlements and lakes, inhabited by thousands of flamingos, dot the valley floor. Arrive by afternoon in the famed ‘Mara’ and venture into the Masai Mara Game Reserve for our first game drive and wildlife encounters. Dinner and overnight at Mara Serena Safari Lodge.','2020-03-09 10:16:40','2020-03-09 10:16:40'),(1504,2335,'06:00','18:00','Masai Mara National Park','Early breakfast followed by game viewing drive in the Masai Mara plains in search for the ‘Big Five’ – leopard, lion, elephant, rhino and buffalo – as well as numerous grazing animals such as wildebeest, zebra and giraffe. Also includes good stocks of hippo and crocodile in the Mara River and an enormous variety of birds. The Mara encompasses many people’s ideal of Africa: rolling green hills, vast open horizons and plains stocked with wildlife. Dinner and Overnight at Mara Serena Safari Lodge.','2020-03-09 10:17:27','2020-03-09 10:17:27'),(1505,2336,'09:00','18:00','Nairobi','we leave the Mara and drive back through Narok, stopping to admire the colorful local markets, before continuing to Nairobi where our safari ends.','2020-03-09 10:18:04','2020-03-09 10:18:04'),(1521,2367,'15:00','18:00','Kilimanjaro International Airport','Arrive at the Kilimanjaro International Airport where you will be met at the airport and be transferred to the Hotel in Moshi for overnight.','2020-03-09 13:01:44','2020-03-09 13:01:44'),(1522,2368,'06:00','18:00','Marangu Gate','After breakfast, you will be collected from your lodge in Moshi and taken to the Marangu gate. Once the necessary paper work has been completed, your trek can begin and you will soon be hiking through the dense rain forest. Alongside the impressive vegetation, you will have the chance to catch a glimpse of some primates as you head to the Mandara Hut. After a well-earned rest, your guide can take you to the Maundi Crater where you can enjoy the wonderful view of the Kenyan interior.','2020-03-09 13:27:35','2020-03-09 13:27:35'),(1523,2369,'06:00','18:00','Horombo Hut','Today serves as an acclimatization day. This should not be underestimated and greatly improves your chance of success in reaching the summit. After a relaxing breakfast, a 4 hour trek follows to the Zebra Rocks (4020m). The distinctive black and white stripes give the rock formation its name. On your return to Horombo Hut, a warm lunch will be waiting for you. You can relax in the afternoon and regain your strength for the hike the following day.','2020-03-09 13:37:28','2020-03-09 13:37:28'),(1524,2371,'06:00','18:00','Uhuru Peak','Today is “The Big Day” - the summit stage. You will begin your final ascent around midnight which will be long and strenuous. Passing the Hans Meyer Cave at 5220m, the climb slowly but surely goes upwards. At sunrise, you will reach Gillman’s Point (5681m) – the crater rim of Kilimanjaro – where the sun will slowly start to warm up the land. You will have soon forgotten the cold of the night and after a further hike of 1 - 2 hours, you will reach Uhuru Peak at 5895m. On your return to Kibo Hut, a warm meal awaits you followed by a 1 - 2 hour break before proceeding back down to Horombo Hut.','2020-03-09 13:38:26','2020-03-09 13:44:32'),(1525,2370,'06:00','18:00','Kibo Huts','Today’s stage is long and tough. The well-built trail passes the “Last Water point” which is followed by the so-called “saddle”. This nearly vegetation less plateau joins the main summit Kibo with Mawenzi. Today’s destination is the Kibo Hut that is usually reached in about 5 - 6 hours. Here, you will enjoy an early evening meal followed by an early night, as the night will be short.','2020-03-09 13:40:42','2020-03-09 13:40:42'),(1526,2372,'06:00','18:00','Marangu Gate','The last stage passes through the heath and moor zone to the Mandara Hut (2700m) where a warm lunch is waiting for you. Soon, you will once again pass the tropical rainforest and after a total time of 6 hours trekking, you will be back at the Kilimanjaro National Park Gate (1860m). After saying goodbye to your mountain guides, a short transfer follows to take you back to your hotel in Moshi. Once there, you can take a warm and relaxing shower and celebrate your success in reaching the summit of the Kilimanjaro.','2020-03-09 13:46:05','2020-03-09 13:46:05'),(1527,2373,'15:00','18:00','Tanzania','Land in Kilimanjaro International Airport and meet a driver guide who will transfer you to your respective hotel/lodge in Arusha. On arrival, check in at Mount Meru Lodge and Sanctuary where you will spend a night.','2020-03-09 14:31:18','2020-03-09 14:31:18'),(1528,2374,'06:00','18:00','Lake Manyara National Park','Have breakfast early in the morning and after, drive to Lake Manyara National Park. Have a stopover in village markets and lunch at the lodge. Later in the afternoon, set off for game drive to view wildlife species like the tree climbing lions. Later, return to the lodge for overnight stay at Lake Manyara Tree House Lodge.','2020-03-09 14:32:15','2020-03-09 14:32:15'),(1529,2375,'06:00','18:00','Ngorongoro Crater','Early in the morning, you will be served breakfast and later, set off to Ngorongoro Crater a game drive. Ngorongoro Crater is a home to over 30000 wildlife species and a game drive at the crater rewards you with views of the black rhinos, zebras, hippos, eland, buffaloes, warthogs, lions, leopards, cheetah and jackals. Later, drive back to the lodge for overnight at Lake Manyara Tree House Lodge.','2020-03-09 14:39:38','2020-03-09 14:39:38'),(1530,2376,'06:00','18:00','Tarangire National Park','After breakfast, you will transfer to Tarangire National Park. Have lunch at Tarangire Safari Lodge while catching clear views of the surrounding area. After, head for game drive which will reward you with amazing views of leopards, lions, elephants and avian species. After, return to the lodge for night stay at Mount Meru Game Lodge.','2020-03-09 14:44:07','2020-03-09 14:44:07'),(1531,2377,'06:00','18:00','Tarangire National Park to Arusha','Have breakfast early in the morning and embark on a journey to Arusha and have overnight stay at Mount Meru Game Lodge.','2020-03-09 14:54:55','2020-03-09 14:54:55'),(1532,2378,'06:00','18:00','Kigali International airport','Following breakfast in the morning in your respective lodge, after, you will be driven to Kilimanjaro International Airport to fly to Rwanda. You will be welcomed by our experienced driver at Kanombe Kigali International Airport who will take you to Musanze for dinner and overnight stay in Virunga Lodge, Sabyinyo Lodge and Bisate Lodge.','2020-03-09 14:56:16','2020-03-09 14:56:16'),(1533,2379,'06:00','18:00','Volcanoes National Park','After breakfast in the morning you will be transferred to the park headquarters for briefing from the park officials on general conduct in the forest as you look out for the group mountain gorillas. Your trek can be 30 minutes to eight hours depending on the location of the gorillas, nature of the terrain and your physical fitness. You will have only one hour of face to face encounter with these apes in the wild and after return for dinner and overnight stay in the previous lodge.','2020-03-09 14:57:17','2020-03-09 14:57:17'),(1534,2380,'09:00','18:00','Kigali International airport','Early in the morning, you will have breakfast at the lodge and after the driver guide will transfer you to Kigali for a short city tour at Gisozi genocide memorial site and after set off to the airport for departure and this marks the end of your 8 days’ safari.','2020-03-09 14:58:05','2020-03-09 14:58:05'),(1541,2393,'15:00','18:00','KIGALI','Welcome! this day at your arrival, you will be picked by our diver guide and transfer you to the hotel for relaxation.\r\nDinner and Overnight at The Retreat by Heaven.','2020-03-12 12:32:19','2020-03-12 12:32:19'),(1542,2394,'07:00','18:00','Kigali -Nyungwe national park','This morning we depart from Kigali to Nyungwe forest having our lunch en-route in Nyanza. We have the opportunity of exploring the King’s Palace Museum in Nyanza. After this experience, we continue our drive to Nyungwe National park head Office for our 3pm Canopy walkway.\r\nDinner and Overnight at One &Only Nyungwe House.','2020-03-12 12:34:06','2020-03-12 12:34:06'),(1543,2395,'05:00','18:00','Nyungwe National Park -Kibuye','After Breakfast, Drive to the park headquarters to be briefed about the “dos and don’ts” while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will be transferred to karongi. This is a 3hrs drive from Nyungwe to Karongi where you will connect to your Hotel for relaxation.\r\nDinner and overnight at Kivu Lodge.','2020-03-12 12:34:46','2020-03-12 12:34:46'),(1544,2396,'07:00','18:00','Kibuye - Volcanoes National Park','Early morning after breakfast, you will do a boat ride and hiking at lake kivu arriving you at Amahoro Island, Inyenyeri Island and Napoleon Island. After enjoying kivu lake, you will go for lunch before being transferred to Musaze. The distance from Karongi to musazne is about 147Km, which takes about 2hrs 51min drive with no rush. \r\nDinner and Overnight at Bisate Lodge.','2020-03-12 12:36:46','2020-03-12 12:36:46'),(1545,2397,'06:00','18:00','Volcanoes National Park','After early morning breakfast, you will be transferred to the park headquarters in Kinigi for a briefing about the endangered mountain gorilla from the park warden. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the gorillas together with the ranger guides. This activity may take between 1-7 hours searching for the gorillas depending on their movement. However, meeting them is so rewarding and you will spend maximally 1 hour with them as you take time studying them and taking pictures and videos. After spending your time with the fascinating mountain gorillas, return to the base and meet your driver and a transfer for lunch. After lunch you will go for Ibyiwacu cultural village to learn about the Rwandan culture and traditions.\r\nDinner and Overnight at Bisate Lodge','2020-03-12 12:37:40','2020-03-12 12:37:40'),(1546,2398,'06:00','18:00','Volcanoes National Park - Kigali','Early in the morning you will take breakfast at the Hotel, then drive to Volcanoes National park headquarters in kinigi for a briefing about the golden Monkeys. Along with your trekking gear and drinking water, the driver will drop you off at the starting point to trek the golden monkeys together with the ranger guides. This activity may take between 1-4 hours searching for the monkeys depending on their movement. They live in bamboo forests near the bottom of the volcanoes, and their habitual life has helped overcome their initial shyness to accept daily visits by researchers and tourists. They are very active animals and seeing them jumping from one tree to another is really interesting. After the Trek, will head for Lunch and later drive back to Kigali.\r\nDinner and Overnight at The Retreat by Heaven.','2020-03-12 12:38:30','2020-03-12 12:38:30'),(1547,2399,'09:00','18:00','Kigali - Nairobi','Depart for Kigali after breakfast and depending on our flight schedule, we can take a city tour in Kigali, visit the genocide memorial sites, art and crafts shops and local markets, do shopping and later proceed to the airport for your flight to Nairobi. \r\n Dinner and Overnight at Intercontinental Nairobi Hotel.','2020-03-12 12:39:45','2020-03-12 12:39:45'),(1548,2400,'07:00','18:00','Nairobi - Masai Mara National Park','Have breakfast and hit the road across the Great Rift Valley, where traditional Masai settlements and lakes, inhabited by thousands of flamingos, dot the valley floor. Arrive by afternoon in the famed ‘Mara’ and venture into the Masai Mara Game Reserve for our first game drive and wildlife encounters\r\nDinner and Overnight at Masara Serena Lodge.','2020-03-12 12:42:03','2020-03-12 12:42:03'),(1549,2401,'06:00','18:00','Masai Mara National Park','Early breakfast followed by game viewing drive in the Masai Mara plains in search for the ‘Big Five’ – leopard, lion, elephant, rhino and buffalo – as well as numerous grazing animals such as wildebeest, zebra and giraffe. Also includes good stocks of hippo and crocodile in the Mara River and an enormous variety of birds. The Mara encompasses many people’s ideal of Africa: rolling green hills, vast open horizons and plains stocked with wildlife.\r\nDinner and Overnight at Mara Serena Safari Lodge.','2020-03-12 12:43:20','2020-03-12 12:43:20'),(1550,2402,'09:00','18:00','Masai Mara National Park -Nairobi','We leave the Mara and drive back through Narok, stopping to admire the colorful local markets, before continuing to Nairobi where our safari ends.','2020-03-12 12:44:23','2020-03-12 12:44:23'),(1551,2403,'15:00','18:00','KIGALI','Upon arrival at Kigali Airport, you will meet your tour guide (Our company representative). Depending on your arrival time, if you arrive evening time, you will have small City tour. Check-in and dinner at Kigali Serena Hotel.','2020-03-13 10:12:24','2020-03-13 10:12:24'),(1552,2404,'07:00','18:00','Kigali -Nyungwe national park','This morning we depart from Kigali to Nyungwe forest having our lunch en-route in Nyanza. We have the opportunity of exploring the King’s Palace Museum in Nyanza. After this experience, we continue our drive to Nyungwe National park head Office for our 3pm Canopy walkway. Dinner and overnight at Nyungwe top View Hotel.','2020-03-13 10:43:39','2020-03-13 10:43:39'),(1553,2405,'05:00','18:00','Nyungwe National Park - Bujumbura','After Breakfast, Drive to the park headquarters to be briefed about the “dos and don’ts” while with the chimps before entering the forest. Trekking chimpanzees is about 1-6 hours (depending on the guest\'s walking Speed and reality) The forest is rich in different types of trees, plants and is home to 13 primates that include chimpanzees, long-tailed monkeys and Columbus monkeys. \r\nAfter lunch, you will drive to Bujumbura city; arrive in the evening to relax, and have dinner at Club du lac Tanganyika Hotel.','2020-03-13 10:45:12','2020-03-13 10:45:12'),(1554,2406,'07:00','18:00','Bujumbura','Early morning after breakfast take a visit to the Source of Nile, drive to Rutana to admire Karera waterfalls; later you will visit the Source of the River Nile at Rutovu, a not-so-small forest with a river stream that several researchers, including the BBC, have corroborated to be the Source of the River Nile, the longest river in Africa and second-longest in the world. Dinner and Overnight at Club du lac Tanganyika Hotel.','2020-03-13 10:46:09','2020-03-13 10:46:09'),(1555,2407,'07:00','18:00','Gishora','After breakfast, you will drive to Gishora drum sanctuary and visit the Burundi National museum, visit Mushasha catholic village and later continue to the ancient administrative offices during colonial time, then after return to your hotel for dinner and overnight.','2020-03-13 10:56:51','2020-03-13 10:56:51'),(1556,2409,'09:00','18:00','KIGALI','Souvenir shopping in local handcraft at kimironko markets and transfer to the airport for your departure flight.','2020-03-13 12:38:11','2020-03-13 12:38:11'),(1557,2408,'07:00','18:00','Bujumbura - Kigali','Take your breakfast at leisure at your hotel and later be ready to drive back to Rwanda. Your guide will drop you at your hotel in Kigali. Dinner and Overnight Serena Hotel.','2020-03-13 12:40:02','2020-03-13 12:40:02');
