INSERT INTO `tour_packages` VALUES (173,1,8,'5 Days - Luxury Safari in Rwanda.','6856360','Explore Rwanda, the land of a thousand hills on our 5 Days/4 Nights Rwanda Safari. \r\nVisit Kigali Memorial Center, Canopy walkway and Chimpanzee Trekking in Nyungwe national park, Lake Kivu Boat ride and hiking, Gorilla Trekking in Volcanoes National Park. \r\n\r\nTour Starts and Ends in Kigali.','Rwanda','Kigali','Kigali','5','1583429066.jpg',NULL,NULL,NULL,'2019-06-21 08:31:35','2020-03-05 17:24:26',NULL),(189,1,11,'4 Days Serengeti Safari','2350000','This 4 Days Serengeti Safari takes you to Serengeti National Park which is located in northern part of Tanzania. Serengeti National Park is known for its massive annual migration of wildebeest and zebra. Seeking new pasture, the herds move north from their breeding grounds in the grassy southern plains. Many cross the marshy western corridor’s crocodile-infested Grumeti River. Others veer northeast to the Lobo Hills, home to black eagles. Black rhinos inhabit the granite outcrops of the Moru Kopjes.','Tanzania','Arusha','Arusha','5','1561652171.jpg',NULL,7,NULL,'2019-06-27 16:16:11','2020-02-26 10:47:50',NULL),(218,1,12,'4 Days Congo Gorilla Trek and Nyiragongo Hike','2,390','This 4 days in Congoi; Includes Congo Mountain Gorilla Trekking and Mountain Nyiragongo Hike. Tour Starts and Ends in Rwanda','Rwanda -Congo','Rwanda','Rwanda','5','1566062263.jpg','N/A',7,0,'2019-08-17 17:17:43','2019-08-17 17:17:43','USD'),(226,1,9,'2 Days Uganda Gorilla Safari.','882660','The 2 days / 1 night  uganda Gorilla Safari  starts and ends in Kigali the capital city of Rwanda.  It\'s includes Gorilla trekking and Batwa Experience in Bwindi National Park.','Rwanda - Uganda','Kigali','Kigali','0','1583176727.jpg','N/A',7,0,'2019-09-02 13:05:45','2020-03-02 19:18:47','RWF'),(232,1,9,'1 Day Jinja City Tour.','188000','Jinja city is located North of Lake Victoria and according to sir Churchill Livingstone, it is here that he discovered the beginning of the longest River in Africa. Jinja is also home of the kingdom of Busoga and thus houses the palace of the kings, and also the Kagulu hills believed to be the ancestral home of ancient Basoga Kings.\r\n\r\nTour starts and ends in Kampala.','Uganda','Kampala','Kampala','0','1567769050.jpg','N/A',7,0,'2019-09-06 11:24:10','2020-03-12 13:48:40',NULL),(264,1,8,'4 Days in Rwanda','1735240','4 Days Rwanda Safari will starts and end in Kigali Rwanda’s Capital it includes; Kigali City Tour ,Akagera boat ride and Game Drive.','Rwanda','Kigali','Kigali','0','1571063930.jpg','N/A',7,0,'2019-10-14 14:38:50','2020-02-03 11:02:21','RWF'),(265,1,8,'4 Days Rwanda Cycling Tour','1692000','This 4Days Musanze cycling tour will give you a different feel from the car and hiking opportunities. You will explore the communities close by and benefit from exercising and enjoying the freshness from the countryside.\r\nTour Starts and Ends in Kgali','Rwanda','Kigali','Kigali','0','1571065747.jpg','N/A',5,0,'2019-10-14 15:09:07','2020-02-03 12:09:38','RWF'),(268,1,9,'3 Days Rwanda &Uganda  Gorilla Safari','1706100','3 Days Rwanda& Uganda Gorilla Safari will starts and ends in Kigali Rwanda’s Capital it includes; Twin lake Burera &Ruhondo, Batwa forest experience and gorilla trekking in bwindi impenetrable national park.','Rwanda - Uganda','Kigali','Kigali','0','1583487135.jpg','N/A',5,0,'2019-10-16 10:50:38','2020-03-12 13:26:43','RWF'),(269,1,9,'4 Days Double Uganda Gorilla Trekking Tour .','2669600','With this 4-Day Double Gorilla Trekking  Uganda Tour through Kigali - Rwanda, one gets to drive for only 4-5 hours from Kigali to Bwindi National Park . Tour will start and end in Kiagli Rwanda.','Rwanda - Uganda','Kigali','Kigali','0','1571233870.jpg','N/A',5,0,'2019-10-16 13:51:10','2020-03-12 14:28:46','RWF'),(270,1,9,'5 Days Rwanda and Uganda Tour','3,972','An adventure 5 Days Rwanda &Uganda You will visit Ibyiwacu Cultural Village in musanze, Lake bunyonyi and  Gorilla trekking in Bwindi National Park.','Rwanda - Uganda','Kigali','Kigali','0','1571324466.jpg','N/A',5,0,'2019-10-17 15:01:06','2019-10-17 15:01:06','USD'),(281,1,14,'2 Days  Akagera Group Tour.','322000','2 Days Akagera group tour takes you to the Akagera National Park Akagera which is located in Eastern Rwanda on the border with Tanzania will give you a great experience to explore this only savanna national park where safari game drive can only be carried in Rwanda. Akagera national park is known for harboring the big 5 with the recent introduction of the lions. Akagera national park is the only Savannah park in Rwanda and is home to several mammal species including Lions, Elephants, Giraffes, Hippos, Kobs, Zebras, Bushbucks, Waterbucks and most recently Black Rhinos','Akagera National Park','Kigali','Kigali','0','1571665834.JPG','N/A',14,0,'2019-10-21 13:50:34','2019-10-21 13:50:34','RWF'),(284,1,14,'2 Days Karisimbi Hiking Adventure','179400','The Mount Karisimbi hiking is one of the most memorable activities in Rwanda, hiking to the top of mount Kalisimbi is one of the key tourism activities you should not miss on your Rwanda safari to Volcanoes National park.','Volcanoes National Park','Kigali','Kigali','0','1571668164.jpg','N/A',14,0,'2019-10-21 14:29:24','2019-10-21 14:29:24','RWF'),(285,1,14,'2 Day Nyungwe Group Tour.','322000','This 2 Days Nyungwe Group Tour takes you to the Nyungwe National Parkfor. Nyungwe is located in the south west, covering an area of 1016 kms across the majestic hills of southeast Rwanda, Nyungwe National Park is the largest mountainous rain forest in central and east Africa and one of the most ancient, dating back to before the Ice Age. The forest supports over 1025 plant species, and over than 500 species of orchid and giant lobelia. Nyungwe also has 13 species of primates; these include chimpanzees and the Black and White Angolan colobus monkeys. It is also home to habituated species such as the Mangabeys and the Blue Monkeys. Nyungwe forest has its own Canopy. And it’s the only canopy in East Africa.','Nyungwe National Park','Kigali','Kigali','0','1571739375.jpg','N/A',14,0,'2019-10-22 10:16:15','2019-10-22 10:16:15','RWF'),(286,1,14,'4 Days  Rwanda Tour','552000','This 4 Days Rwanda Tour; Includes Game drive in Akagera National Park, Lake Kivu Boat Tour and Golden Monkey in Volcanoes National Park.\r\n\r\nTour Starts and Ends in Kigali.','Rwanda','Kigali','Kigali','0','1571745969.jpg','N/A',14,0,'2019-10-22 12:06:09','2019-10-22 12:06:09','RWF'),(287,1,14,'5 Days Rwanda Tour.','736000','The Safari highlights;\r\nAkagera Game drive, Boat tour, Kigali city tour, Rwanda museum, Canopy walk, Chimpanzee trekking in Nyungwe National park, Environmental museum plus Kivu Lake Tour.\r\n(The safari starts and ends in Kigali)','Rwanda','Kigali','Kigali','0','1571748789.JPG','N/A',14,0,'2019-10-22 12:53:09','2019-10-22 12:53:09','RWF'),(289,1,14,'3 Days Rwanda Group Tour','276000','This 3 Days Rwanda Tour; Includes, Canopy Walk way &Kamiranzovu Water fall in Nyungwe National park, Lake Kivu Boat Tour in Karongi.\r\n\r\nTour Starts and Ends in Kigali.','Rwanda','Kigali','Kigali','0','1571758020.jpg','N/A',14,0,'2019-10-22 15:27:00','2019-10-22 15:27:00','RWF'),(295,1,13,'4 Days Burundi Tour(Min-6 Pax)','828000','The 4 Days Burundi tour takes you to explore Burundi Wildlife in Rusizi National Park. Also enjoy a boat cruise on the Rusizi river as you watch different bird species and other water animals such as hippos.','Burundi','Bujumbura','Bujumbura','0','1572022367.jpg','N/A',7,0,'2019-10-25 16:52:47','2019-10-25 16:52:47','RWF'),(313,1,9,'10 Days -Rwanda & Uganda Adventure Tour(Min-6Pax)','3107760','In this 10 Days/9 Nights Rwanda and Uganda adventure Tour, you will visit King’s Place Museum in Nyanza, Ethnographic Museum in Huye, Kamiranzovu Water fall, Canopy walk way &Chimpanzee Trekking in Nyungwe National Park, Lake Kivu Boat Ride, hiking to Mountain Bisoke & Mountain Kigali, Ibyiwacu Cultural Village in Volcanoes National Park, Batwa Forest Experience and Gorilla trekking in Uganda.\r\n\r\nTour Starts and Ends in Kigali.','Rwanda - Uganda','Kigali','Kigali','5','1573128903.JPG','N/A',NULL,0,'2019-11-07 12:15:03','2019-11-11 09:29:16','RWF'),(315,1,9,'12 Days  - Rwanda & Uganda Luxury Safari (Min - 6Pax)','7841160','In this 12 days Rwanda and Uganda Safari, you will visit King’s Place Museum in Nyanza, Canopy walk way &Chimpanzee Trekking in Nyungwe National Park, Lake Kivu Boat Ride, Lake Bunyonyi Boat Ride, Twin Lakes, Ibyiwacu Cultural Village and Golden Monkey Trekking in Volcanoes National Park, Batwa Experience, Gorilla trekking in Bwindi, Queen Elizabeth Game Drive and Boat Ride on Kazinga Channel.\r\n\r\nTour starts and Ends in Kigali.','Rwanda - Uganda','Kigali','Kigali','5','1573137035.jpg','N/A',NULL,0,'2019-11-07 14:30:35','2019-11-11 09:57:34','RWF'),(316,1,9,'12 Days Best Of Rwanda&Uganda Safari (Min 6-Pax)','4508000','In this 12 days Rwanda and Uganda Safari, you will visit King’s Place Museum in Nyanza, Canopy walk way &Chimpanzee Trekking in Nyungwe National Park, Lake Kivu Boat Ride, Lake Bunyonyi Boat Ride, Twin Lakes, Ibyiwacu Cultural Village and Golden Monkey Trekking in Volcanoes National Park, Batwa Experience, Gorilla trekking in Bwindi, Queen Elizabeth Game Drive and Boat Ride on Kazinga Channel.\r\n\r\nTour starts and Ends in Kigali.','Rwanda - Uganda','Kigali','Kigali','0','1573201590.jpg','N/A',NULL,0,'2019-11-08 08:26:30','2019-11-11 09:52:22','RWF'),(317,1,9,'20 Days - Safari in 5 Countries','14397080','20 Days 5 Countries, an adventure tour to Congo, Rwanda, Burundi, Uganda and Kenya Includes, Gorilla trekking, Mountain Nyiragongo Hike, Chimpanzee Trekking, Canopy Walk Way, Wildlife Game Viewing, Water Falls, Lakes, Beautiful Sceneries and Cultural Visits.\r\n\r\nTour Starts in Goma and Ends in Nairobi Kenya.','Congo-Rwanda-Burundi-Uganda -Kenya','Goma','Nairobi','5','1573207800.jpg','N/A',NULL,0,'2019-11-08 10:10:00','2019-11-11 09:18:18','RWF'),(318,1,10,'20 Days - Safari in 5 Countries','14397080','20 Days 5 Countries, an adventure tour to Congo, Rwanda, Burundi, Uganda and Kenya Includes, Gorilla trekking, Mountain Nyiragongo Hike, Chimpanzee Trekking, Canopy Walk Way, Wildlife Game Viewing, Water Falls, Lakes, Beautiful Sceneries and Cultural Visits.\r\n\r\nTour Starts in Congo and  Ends in Nairobi Kenya.','Congo-Rwanda-Burundi-Uganda -Kenya','Goma','Nairobi','5','1573216226.jpg','N/A',NULL,0,'2019-11-08 12:30:26','2019-11-11 09:21:32','RWF'),(319,1,12,'20 Days - Safari in 5 Countries','14397080','20 Days 5 Countries, an adventure tour to Congo, Rwanda, Burundi, Uganda and Kenya Includes, Gorilla trekking, Mountain Nyiragongo Hike, Chimpanzee Trekking, Canopy Walk Way, Wildlife Game Viewing, Water Falls, Lakes, Beautiful Sceneries and Cultural Visits.\r\n\r\nTour Starts in Goma and  Ends in Nairobi Kenya.','Congo-Rwanda-Burundi-Uganda -Kenya','Goma','Nairobi','5','1573220534.jpg','N/A',NULL,0,'2019-11-08 13:42:14','2019-11-11 09:24:14','RWF'),(322,1,8,'6 Days - Safari In Rwanda','4380400','Explore Rwanda, the land of a thousand hills on our 6 Days/5 Nights Rwanda Safari. \r\nVisit Kigali Memorial Centre, Canopy walkway and Chimpanzee Trekking in Nyungwe national park, Lake Kivu Boat ride and hiking, Gorillas, Golden Monkeys Trekking and Ibyiwacu cultural Village in Volcanoes National Park.\r\n\r\nTour Starts and Ends in Kigali.','Rwanda','Kigali','Kigali','0','1583429788.jpg','N/A',5,0,'2019-11-12 09:40:58','2020-03-05 17:36:28',NULL),(329,1,8,'20 Days - Rwanda Adventure Tour','12987640','Explore Rwanda, the land of a thousand hills on our 20 Days/19 Nights Rwanda Adventure Tour.  Visit All Rwanda National Parks, Community Activities, Cultural Tours and Boat Tours.\r\n\r\n Tour Starts and Ends in Rwanda','Rwanda','Kigali','Kigali','0','1573739933.jpg','N/A',NULL,0,'2019-11-14 13:58:53','2019-11-14 14:02:40','RWF'),(330,1,8,'2 Days - Akagera Safari.','878500','2 Days Akagera Safari takes you to the Akagera National Park Akagera which is located in Eastern Rwanda on the border with Tanzania will give you a great experience to explore this only savanna national park where safari game drive can only be carried in Rwanda. Akagera national park is known for harboring the big 5 with the recent introduction of the lions. Akagera national park is the only Savannah park in Rwanda and is home to several mammal species including Lions, Elephants, Giraffes, Hippos, Kobs, Zebras, Bushbucks, Waterbucks and most recently Black Rhinos. \r\n\r\nTour Starts and Ends in Kigali.','Rwanda','Kigali','Kigali','0','1573824967.jpg','N/A',NULL,0,'2019-11-15 13:36:07','2020-02-07 09:28:31','RWF'),(331,1,8,'2 Days- Hiking Karisimbi Adventure.','913680','The Mount Karisimbi hiking is one of the most memorable activities in Rwanda, hiking to the top of mount Kalisimbi is one of the key tourism activities you should not miss on your Rwanda safari to Volcanoes National park.','Volcanoes National Park','Kigali','Kigali','0','1574074841.jpg','N/A',NULL,0,'2019-11-18 11:00:41','2020-02-07 15:11:55','RWF'),(333,1,8,'2 Days -Bird Watching Safari.','762500','The 2 days Bird Watching Safari, takes you to Nyungwe National park for bird watching, visit museums along the way. The safari starts and ends in Kigali.','Nyungwe National Park','Kigali','Kigali','0','1574334165.jpg','N/A',NULL,0,'2019-11-21 11:02:45','2020-02-07 16:15:14','RWF'),(334,1,8,'2 Days - Gorilla Trekking  &Kigali City Tour.','2251300','2 Days Gorilla Trek & Kigali City Tour will starts and ends in Kigali Rwanda’s Capital it includes Kigali Genocide Memorial site, Campaign against Genocide, ibyiwacu culture village and Gorilla Trekking in Volcanoes National Park.','Volcanoes National Park','Kigali','Kigali','0','1574335655.jpg','N/A',NULL,0,'2019-11-21 11:27:35','2020-02-07 16:49:54','RWF'),(335,1,8,'3 Days - Rwanda Gorilla Naming Ceremony.','2805900','This 3 days Tour Will takes you to Volcanoes National Park for Gorilla Naming Ceremony in kinigi , Gorilla trekking and Twin Lakes Boat ride.\r\nTour Starts and Ends in Kigali.','Volcanoes National Park','Kigali','Kigali','0','1574338113.jpg','N/A',NULL,0,'2019-11-21 12:08:33','2020-02-17 14:49:29','RWF'),(336,1,8,'2 Days - Kivu Boat Ride & Bisoke Hike.','752000','This 2 Days / 1Night includes; Lake Kivu Boat ride\r\nand Hike to Mountain Bisoke Crater Lake in Volcanoes National Park.\r\n\r\nThe Tour Starts and Ends in Kigali.','Rwanda','Kigali','Kigali','0','1574413528.jpg','N/A',NULL,0,'2019-11-22 09:05:28','2020-02-13 10:53:32','RWF'),(341,1,11,'Day Safari to Lake Manyara National Park','62040','This one-day safari takes you to Lake Manyara National Park. Lake Manyara National Park is a protected area in Tanzania\'s Arusha and Manyara Regions, situated between Lake Manyara and the Great Rift Valley. It is administered by the Tanzania National Parks Authority, and covers an area of 325 km² including about 230 km² lake surface. Lake Manyara has a big number of elephants, so many giraffes; zebras, wildebeest, impala, waterbuck, and warthog, small known shy Kik’s dik dik as well as Klipspringer along the ramps of the escarpment.\r\nTour Starts and Ends in Arusha.','Lake Manyara National Park','Arusha','Arusha','0','1575888563.jpg','N/A',NULL,0,'2019-12-09 10:49:23','2019-12-09 15:04:38','RWF'),(349,1,11,'2Days trip to Tarangire&Ngorongoro.','752000','A short 2 –day program to enjoy wildlife and landscape, the tour will lead you towards Tarangire National Parks famous as “Small Serengeti.” The park is well-known for its giant Baobab trees, huge herds of elephants, plains game, and predators. Ngoro Ngoro Crater where you will descend 2000 feet home to large numbers of wildlife and exhilarating landscapes. The best quick tour to experience two of the best Tanzania National park.\r\n\r\nTour Starts and Ends in Arusha.','Tanzania','Arusha','Arusha','0','1576759519.jpg','N/A',NULL,0,'2019-12-19 12:45:19','2020-02-26 10:03:36',NULL),(354,1,8,'2 Days Akagera camping Tour.','733500','2 Days Akagera  tour takes you to the Akagera National Park Akagera which is located in Eastern Rwanda on the border with Tanzania will give you a great experience to explore this only savanna national park where safari game drive can only be carried in Rwanda. Akagera national park is known for harboring the big 5 with the recent introduction of the lions. Akagera national park is the only Savannah park in Rwanda and is home to several mammal species including Lions, Elephants, Giraffes, Hippos, Kobs, Zebras, Bush bucks, Water bucks and most recently Black Rhinos.\r\n\r\nTour Starts and Ends in Kigali.','Akagera','kigali','Kigali','0','1576761623.jpg','N/A',NULL,0,'2019-12-19 13:20:23','2020-02-14 09:45:25','RWF'),(379,1,8,'3 Days Rwanda Gorillas & Wildlife Safari.','3050300','This 3 days Rwanda Gorilla safari; Includes Game drive in Akagera National Park, Lake Kivu Boat Tour and Gorilla Trekking in Volcanoes National Park.\r\nTour Will starts and Ends in Kigali Rwanda.','Rwanda','Kigali','Kigali','0','1578499803.jpg','N/A',5,0,'2020-01-08 16:10:03','2020-02-17 14:25:26','RWF'),(383,1,8,'4 Days- Safari in Rwanda','1829240','This 4 Days Rwanda Safari will starts and Ends in Kigali Rwanda  and it\'s Includes; Akagera Game drive , Lake Kivu boat ride and Golden Monkey in Volcanoes National Park.\r\nTour Starts and Ends in Kigali.','Rwanda','Kigali','Kigali','0','1579611595.JPG','N/A',5,0,'2020-01-21 12:59:55','2020-02-03 12:46:41','RWF'),(394,1,8,'1 Day Gorilla trekking Tour.','1598000','This 1-day gorilla tour is designed for clients who don’t have much stay in Rwanda but would like to have a gorilla experience. This Gorilla tour takes you to volcanoes national park, which is home to the endangered mountain gorillas.\r\n\r\nTour Starts and Ends in Kigali.','Volcanoes National Park','Kigali','Kigali','0','1579970959.jpg','N/A',7,0,'2020-01-25 16:49:19','2020-02-12 08:57:40','RWF'),(395,1,8,'Day Trip to Mountain Bisoke.','217000','A one-day tour to hike Mount Bisoke is one of the thrilling experiences for hiking lovers and should not be missed while in Rwanda. Travelers hike and descend on the same day hence giving a chance to those with a short time. Mount Bisoke stands at 3,711 meters and one of the 8 volcanoes that make the chain of Virunga volcanoes.\r\n\r\nTour Will Starts and End in Kigali.','Volcanoes National Park','Kigali','Kigali','0','1579972733.jpg','N/A',7,0,'2020-01-25 17:18:53','2020-02-12 08:57:14','RWF'),(396,1,8,'Day Trip to Akagera  National Park.','200000','1 Day Akagera Safari takes you to the Akagera National Park Akagera which is located in Eastern Rwanda on the border with Tanzania will give you a great experience to explore this only savanna national park where safari game drive can only be carried out in Rwanda. Akagera national park is known for harboring the big 5 with the recent introduction of the lions. Akagera national park is the only Savannah park in Rwanda and is home to several animals including Lions, Elephants, Giraffes, Hippos, Kobs, Zebras, Bushbucks, Waterbucks and most recently Black Rhinos.\r\n\r\nTour Starts and Ends in Kigali','Akagera National Park','Kigali','Kigali','0','1580044388.jpg','N/A',7,0,'2020-01-26 13:13:08','2020-02-12 08:58:26','RWF'),(397,1,8,'Day Trip  to Canopy Walk Way.','200000','This 1-day canopy adventure takes you to the Nyungwe National Park\r\nfor the canopy walk along the trails. Nyungwe is located in the south west, covering an area of 1016 Kms across the majestic hills of southeast Rwanda, Nyungwe National Park is the largest mountainous rain forest in central and east Africa and one of the most ancient, dating back to before the Ice Age. The forest supports over 1025 plant species, and 500 species of orchid and giant lobelia. Nyungwe also has 13 species of primates; these include chimpanzees and the Black and White Angolan colobus monkeys. It is also home to habituated species such as the Mangabeys and the Blue Monkeys. Nyungwe forest has its own Canopy. And it’s the only canopy in East Africa.\r\n\r\nTour Starts and Ends in Kigali.','Nyungwe National Park','Kigali','Kigali','0','1580051464.jpg','N/A',7,0,'2020-01-26 15:11:04','2020-02-12 09:08:03','RWF'),(399,1,8,'4 Days-  Akagera Safari & Kigali City Tour.','1875000','This 4 Days Rwanda Safari will starts and Ends in Kigali Rwanda and it\'s Includes; Kigali City tour, Akagera Game drive &Boat Safari.\r\nTour Starts and Ends in Kigali.','Rwanda','Kigali','Kigali','0','1580750222.JPG','N/A',NULL,0,'2020-02-03 17:17:02','2020-02-03 17:17:02','RWF'),(401,1,8,'5 Days 4Nights-Rwanda Safari.','2086800','Explore Rwanda, The land of a thousand hills on our 5 Days/4Nights Rwanda Tour. Explore the \r\nKigali City, Genocide Memorial Center, Rwanda National Museum, Chimpanzee Trekking& Canopy walkway in Nyungwe national park plus a Lake kivu Boat Tour. \r\nTour Starts and Ends in Kigali Rwanda.','Rwanda','Kigali','Kigali','0','1580899102.jpg','N/A',5,0,'2020-02-05 10:38:22','2020-02-05 11:02:51','RWF'),(425,1,8,'2 Days -Trip to Gisenyi Lake Kivu.','579000','This 2 days tour takes you to Gisenyi (Lake Kivu).\r\nA trip to GISENYI at lake Kivu is fantastic and pleasant way to spend some time relaxing on the water as you enjoy the little peace and quiet.\r\n\r\nThe lake is lies on the border between the Democratic Republic of Congo and Rwanda and is in the Albertine (western) Rift, a part of the great Rift valley.\r\n\r\nTour Starts and Ends in Kigali.','Gisenyi','Kigali','Kigali','0','1581675088.jpg','N/A',5,0,'2020-02-14 10:11:09','2020-02-14 12:34:01','RWF'),(426,1,8,'2 Days - Gorilla Trekking & Mukungwa River Canoe.','2312400','2 Days Gorilla Treks and Cultural safari.  involves a tour to Gisozi Memorial site, Mukugwa River Canoe and Gorilla trekking in Volcanoes National Park.\r\n\r\nTour starts and Ends in Kigali.','Volcanoes National Park','Kigali','Kigali','0','1581683339.jpg','N/A',5,0,'2020-02-14 12:28:59','2020-02-14 14:14:46','RWF'),(427,1,8,'Day trip to Gisenyi Lake Kivu.','376000','This one-day trip takes you to Gisenyi (Lake Kivu).\r\nA trip to GISENYI at lake Kivu is fantastic and pleasant way to spend some time relaxing on the water as you enjoy the little peace and quiet.\r\n\r\nThe lake is lies on the border between the Democratic Republic of Congo and Rwanda and is in the Albertine (western) Rift, a part of the great Rift valley.\r\n\r\n\r\nTour Starts and Ends in Kigali.','Gisenyi','Kigali','Kigali','0','1581697032.jpg','N/A',5,0,'2020-02-14 16:17:12','2020-02-14 16:23:26','RWF'),(428,1,8,'Day trip to Karongi Lake Kivu.','376000','This itinerary is short and sweet.!\r\ntour highlights include: visiting waterfall/ndabarock, Hiking Napoleon island, king and queen island, Games & visiting peace islands.\r\n\r\nTour Starts and Ends in Kigali.','Karongi','Kigali','Kigali','0','1581699159.jpg','N/A',5,0,'2020-02-14 16:52:39','2020-02-14 16:52:39','RWF'),(429,1,8,'2 Days- Chimpanzee Trekking &Canopy Walk Way.','940000','This 2days Takes you to Nyungwe national park for Canopy walkway and chimpanzee trekking. \r\nNyungwe National Park Rwanda is a massive mountain Forest in the southwest of Rwanda.\r\nNyungwe forest has 13 species of primate including chimpanzee and large groups of Rwenzori colobus. Nyungwe forest also boasts a rich bird life of about 300 bird species, you will also find orchids and butterflies among other attractions. Nyungwe’s biodiversity is astonishing by African standards and is one of the most endemic species-rich areas in Africa.','Nyungwe National Park','Kigali','Kigali','0','1581702440.jpg','N/A',5,0,'2020-02-14 17:47:20','2020-02-17 12:09:11','RWF'),(431,1,8,'2 Days - Kibuye Tour','579000','This itinerary is short and sweet.!\r\ntour highlights include: visiting Environmental Museum, Hiking Napoleon island, king and queen island, Games and visiting peace islands. \r\n\r\n\r\nTour Starts and Ends in Kigali.','Kibuye','Kigali','Kigali','0','1581947929.jpg','N/A',5,0,'2020-02-17 13:54:25','2020-02-17 14:09:48','RWF'),(433,1,8,'3 Days- Lake Kivu Kayaking.','1198500','This 3 days includes: Kigali city tour, a visit to Environmental museum and Kayaking on lake kivu. This safari starts and ends in Kigali.','Kibuye','Kigali','Kigali','0','1581953879.jpg','N/A',5,0,'2020-02-17 15:37:59','2020-02-23 13:09:46','RWF'),(438,436,8,'15 Days - Safari in Rwanda.','11040300','Explore Rwanda, the land of a thousand hills on our 15Days/14Nights Rwanda Safari. \r\nVisit Rwanda national parks, Community Activities, Cultural tours and Boat tours on Kivu lake and Twin Lakes. Tour starts and Ends in Kigali.','Rwanda','Kigali','Kigali','0','1582890110.jpg','N/A',7,0,'2020-02-28 11:41:50','2020-02-28 11:41:50','RWF'),(442,436,8,'Kigali City Tour','188000','This Kigali Afternoon city tour itinerary gives you an exceptional feel of Africa’s beautiful and cleanest city “Kigali” which is also a hub of the rolling “A thousand hills of Rwanda”. This tour includes a visit to Genocide Memorial site, Camp Kigali Belgian Memorial,Campaign Against Genocide Museum,Kigali High-end Hotels, Local markets and Craft shops .','KIGALI','Kigali','Kigali','0','1583224520.jpg','N/A',NULL,0,'2020-03-03 08:35:20','2020-03-03 08:57:23',NULL),(444,436,14,'Kigali Morning City Tour','47000','This Kigali Morning city tour itinerary gives you an exceptional feel of Africa’s beautiful and cleanest city “Kigali” which is also a hub of the rolling “A thousand hills of Rwanda”. This tour includes a visit to Kigali Genocide Memorial site, Kigali Belgian Peace Keepers Memorial,Campaign Against Genocide Museum , Visit craft shops and Local markets.\r\n\r\nTour Starts and Ends in Kigali.','KIGALI','Kigali','Kigali','0','1583248451.jpg','N/A',NULL,0,'2020-03-03 15:14:11','2020-03-03 15:20:33',NULL),(445,436,14,'Kigali Afternoon City Tour','47000','This Kigali Morning city tour itinerary gives you an exceptional feel of Africa’s beautiful and cleanest city “Kigali” which is also a hub of the rolling “A thousand hills of Rwanda”. This tour includes a visit to Kigali Genocide Memorial site, Kigali Belgian Peace Keepers Memorial,Campaign Against Genocide Museum , Visit craft shops and Local markets.','KIGALI','Kigali','Kigali','0','1583249922.jpg','N/A',NULL,0,'2020-03-03 15:38:42','2020-03-03 15:54:31',NULL),(446,436,14,'Kigali Evening City Tour &Rwanda Cultural Dances','75200','This Kigali Afternoon city tour itinerary gives you an exceptional feel of Africa’s beautiful and cleanest city “Kigali” which is also a hub of the rolling “A thousand hills of Rwanda”. This tour includes a visit to Kigali Belgian Peace Keepers Memorial, Nyamirambo City, Local markets, Craft shops and Rwandan Traditional Dances.\r\n\r\nTour Starts and Ends in Kigali.','KIGALI','Kigali','Kigali','0','1583253257.jpg','N/A',NULL,0,'2020-03-03 16:34:17','2020-03-03 16:34:17','RWF'),(447,436,14,'Group tour to Canopy Walk Way','30000','This 1-day canopy adventure takes you to the Nyungwe National Park\r\nfor the canopy walk along the trails. Nyungwe is located in the south west, covering an area of 1016 Kms across the majestic hills of southeast Rwanda, Nyungwe National Park is the largest mountainous rain forest in central and east Africa and one of the most ancient, dating back to before the Ice Age. The forest supports over 1025 plant species, and 500 species of orchid and giant lobelia. Nyungwe also has 13 species of primates; these include chimpanzees and the Black and White Angolan colobus monkeys. It is also home to habituated species such as the Mangabeys and the Blue Monkeys. Nyungwe forest has its own Canopy. And it’s the only canopy in East Africa.\r\n\r\nTour Starts and Ends in Kigali.','Nyungwe National Park','Kigali','Kigali','0','1583314691.jpg','N/A',7,0,'2020-03-04 09:28:08','2020-03-04 11:47:08',NULL),(448,436,14,'Group to Akagera National Park','40000','1 Day Akagera Safari takes you to the Akagera National Park Akagera which is located in Eastern Rwanda on the border with Tanzania will give you a great experience to explore this only savanna national park where safari game drive can only be carried out in Rwanda. Akagera national park is known for harboring the big 5 with the recent introduction of the lions. Akagera national park is the only Savannah park in Rwanda and is home to several animals including Lions, Elephants, Giraffes, Hippos, Kobs, Zebras, Bushbucks, Waterbucks and most recently Black Rhinos.\r\n\r\nTour Starts and Ends in Kigali','KIGALI','Kigali','Kigali','0','1583323509.jpg','N/A',5,0,'2020-03-04 12:05:09','2020-03-04 12:05:09',NULL),(449,436,14,'Group tour to Mountain Gorillas','1466400','This 1-day gorilla tour is designed for clients who don’t have much stay in Rwanda but would like to have a gorilla experience. This Gorilla tour takes you to volcanoes national park, which is home to the endangered mountain gorillas.\r\n\r\nTour Starts and Ends in Kigali.','Volcanoes National Park','Kigali','Kigali','0','1583324993.jpg','N/A',7,0,'2020-03-04 12:29:53','2020-03-04 12:29:53',NULL),(450,436,8,'7 Days - Rwanda Luxury Safari','9149960','Explore Rwanda, the land of a thousand hills on our 7 Days/6 Nights Rwanda Safari. \r\nVisit Akagera national park, Ethnographic Museum, Canopy walkway, Chimpanzee Trekking in Nyungwe national park, Lake Kivu Boat ride and hiking, Gorilla Trekking and Ibyiwacu cultural Village in Volcanoes National Park.\r\n\r\nTour starts and Ends in Kigali.','Rwanda','Kigali','Kigali','0','1583425572.jpg','N/A',7,0,'2020-03-05 15:53:16','2020-03-05 16:26:12',NULL),(451,436,8,'8 Days in Rwanda','5217000','Explore Rwanda, the land of a thousand hills on our 8 Days/7Nights Rwanda Safari. \r\nVisit Akagera national park, Ethnographic Museum, Canopy walkway, Chimpanzee Trekking in Nyungwe national park, Lake Kivu Boat ride and hiking, Gorillas and Golden Monkeys Trekking and Ibyiwacu cultural Village in Volcanoes National Park.\r\n\r\nTour starts and Ends in Kigali.','Rwanda','Kigali','Kigali','0','1583434413.jpg','N/A',7,0,'2020-03-05 18:53:33','2020-03-05 18:53:33','RWF'),(452,436,8,'9 Days Rwanda  Adventure Tour','5542240','Explore Rwanda, the land of a thousand hills on our 9Days Rwanda Safari. Visit Akagera national park, National Museum, Canopy walk-way, Chimpanzee Trekking in Nyungwe national park, Lake Kivu Boat ride, Gorilla Trekking, Ibyiwacu cultural Village &Golden Monkey in Volcanoes National Park. \r\n\r\nTour starts and Ends in Kigali.','Rwanda','Kigali','Kigali','0','1583435484.jpg','N/A',7,0,'2020-03-05 19:11:24','2020-03-05 19:11:24',NULL),(453,436,8,'10 Days in Rwanda','5828000','Explore Rwanda, the land of a thousand hills on our 10Days Rwanda Safari. Visit Akagera national park, King’s Palace Museum, Canopy walk-way, Chimpanzee Trekking in Nyungwe national park, Lake Kivu Boat ride, Gorilla Trekking, Ibyiwacu cultural Village, Twin Lakes &Golden Monkey in Volcanoes National Park. \r\nTour starts and Ends in Kigali.','Rwanda','Kigali','Kigali','0','1583436792.jpg','N/A',NULL,0,'2020-03-05 19:33:12','2020-03-05 19:33:25',NULL),(454,436,8,'11 Days Rwanda Adventure Tour','7027440','11 Days Rwanda Adventure Tour Includes; chimpanzees tracking, colobus monkey and canopy walk way in Nyungwe national park, Kibuye and Gisenyi tours, a tour to Ibyiwacu Cultural Village& Tour to Twin lakes, Gorilla trekking, Golden Monkey trek in Volcanoes national park, Boat ride and game drive in akagera national park.\r\n\r\nTour starts and ends in Kigali.','Rwanda','Kigali','Kigali','0','1583438008.jpg','N/A',7,0,'2020-03-05 19:53:28','2020-03-05 19:53:28','RWF'),(455,436,8,'12 Days in Rwanda','8037940','This 12 Days Rwanda Safari will starts and ends in Kigali and it\'s Includes a visit to Akagera National Park, Volcanoes National Park, Nyungwe National Park and Kigali City Tour.','Rwanda','Kigali','Kigali','0','1583439786.jpg','N/A',7,0,'2020-03-05 20:23:06','2020-03-05 20:23:06','RWF'),(456,436,9,'6 Days Rwanda Gorilla trek and Uganda Wildlife Safari','3362380','An adventure 6 day Rwanda gorilla trek and Uganda wildlife safari. You will visit Volcanoes national park and Kibare National park before proceeding to Queen Elizabeth national park for a wildlife experience. \r\nTour Starts and Ends in Rwanda.','Rwanda - Uganda','Kigali','Kigali','0','1583489056.jpg','N/A',7,0,'2020-03-06 10:04:16','2020-03-06 10:26:17',NULL),(457,436,9,'8 Days Rwanda and Uganda Safari','3096360','The 8 Days Uganda and Rwanda Tour involve; game viewing, Water Rafting Along River Nile, Boat cruise at Kazinga channel, Gorilla trekking in Bwindi Forest, a tour to Pygmy village, Uganda Museums. Kivu boat ride and Canopy Walk way in Rwanda. The gorilla Adventure Tour starts in Uganda and Ends in Kigali.','Rwanda - Uganda','Kigali','Kigali','0','1584030825.jpg','N/A',NULL,0,'2020-03-06 12:03:05','2020-03-12 16:33:45',NULL),(458,436,9,'9 Days  Best of Uganda and Rwanda Tour','58242440','This 9 Days Uganda Rwanda Tour will take you to the most famous tourist destinations in Uganda and Rwanda. You will visit the Source of river Nile in Jinja, Kibale National Park, Queen Elizabeth National Park and Volcanoes National Park in Rwanda.\r\n\r\nTour starts in Uganda and Ends in Kigali Rwanda.','Rwanda - Uganda','Kigali','Kigali','0','1583514030.jpg','N/A',7,0,'2020-03-06 17:00:30','2020-03-06 17:00:30','RWF'),(459,436,10,'6 Days Best of Rwanda and Kenya Safari','7800120','6 Days Best of Rwanda Kenya Safari. This Safari goes to Volcanoes National park (Rwanda) known as Parc des Volcans, a home to 360 Mountain gorillas, later connect to Masai mara National park in kenya.','Rwanda -Kenya','Kigali','Nairobi','0','1583521456.jpg','N/A',NULL,0,'2020-03-06 19:04:16','2020-03-12 10:27:21',NULL),(462,436,11,'6 Days Marangu Route, Mount Kilimanjaro.','705000','The Marangu route is perhaps the easiest and most comfortable route to reach the summit of Mt Kilimanjaro. The route is well-developed and the climb is constant and moderate. Only the approach to the summit is the exception as it is slightly more demanding. The accommodation on this tour is in simple mountain huts, which might be an advantage compared to the camping routes.\r\nTour Starts and Ends in Tanzania.','Tanzania','Kilimanjaro International Airport','Kilimanjaro International Airport','0','1583758741.jpg','N/A',NULL,0,'2020-03-09 12:59:01','2020-03-09 12:59:01',NULL),(463,436,11,'8 Days Tanzania and Rwanda Safari (Min -6pax)','1840000','8 days Tanzania Rwanda Safari combines Rwanda and Tanzania. You will start in Tanzania and spend 5 days. You will then fly to Rwanda where you will see mountain gorillas in Volcanoes National park.','Rwanda -Tanzania','Nariobi','Kigali','0','1583764122.jpg','N/A',7,0,'2020-03-09 14:28:42','2020-03-09 14:40:21',NULL),(465,436,10,'10 DAYS –RWANDA &KENYA LUXURY SAFARI','8742940','In this 10days/9Nights Rwanda and Uganda Kenya Tour, you will visit King’s Place Museum in Nyanza, Canopy walk way &Chimpanzee Trekking in Nyungwe National Park, Lake Kivu Boat Ride, Mountain Gorilla Trekking, Golden Monkey& Ibyiwacu Cultural Village in Volcanoes National Park, and later connect to Masai Mara National Park in Kenya.\r\n\r\n\r\nTour Starts in Kigali Ends in Nairobi Kenya.','Rwanda -Kenya','Kigali','Nairobi','0','1584015225.jpg','N/A',NULL,0,'2020-03-12 12:13:45','2020-03-12 12:13:45','RWF'),(466,436,13,'7 Days Rwanda and Burundi Safari.','110913400','This 7 days Rwanda and Burundi Tour Includes; Canopy Walk Way and Chimpanzee Trekking in Nyungwe National Park, a visit to the source of Nile, Karere Waterfalls and Gishora drum sanctuary in Burundi.\r\n\r\nTour starts and Ends in Kigali Rwanda.','Rwanda +Burundi','Kigali','Kigali','0','1584093999.jpg','N/A',NULL,0,'2020-03-13 10:06:39','2020-03-13 10:06:39',NULL);
